INSERT INTO `ems_mas_consents` (`cons_id`, `cons_name`, `cons_value`, `consis_deleted`) VALUES
(1, 'Consent for treatment and transport to Government/ Trust hospital', 'a:3:{s:2:\"en\";s:899:\"I, voluntarily agree to be treated and transported to the nearest appropriate Government/Trust hospital by {amb_services} ambulance service.\n\nI also provide my consent to the provision of all medical treatment on scene and en route to the hospital that would be judged appropriate for me by the medical personnel on the ambulance. I have been informed and understand the risks that may arise on scene and en route to hospital due to my medical condition.\n\nI also understand that risks may not have been discussed due to urgent nature for transportation either due to my medical condition or transportation itself.\n\nI acknowledge that no guarantees have been made to me as to the results of medical care provided.\n\nI certify that this form has been explained to me and have had the opportunity to ask questions about this form which have been answered satisfactorily.\";s:2:\"hn\";s:2112:\",           /           \n\n                                                          \n\n                                \n                \n\n                            \";s:2:\"kn\";s:2198:\",       /   {amb_services}    .\n\n               .               .\n\n               .\n\n          .\n\n               .\";}', '0'),
(2, 'Consent for treatment and transport to Private hospital', 'a:3:{s:2:\"en\";s:889:\"I, voluntarily agree to be treated and transported to the nearest appropriate Private hospital by {amb_services} ambulance service.\n\nI also provide my consent to the provision of all medical treatment on scene and en route to the hospital that would be judged appropriate for me by the medical personnel on the ambulance. I have been informed and understand the risks that may arise on scene and en route to hospital due to my medical condition.\n\nI also understand that risks may not have been discussed due to urgent nature for transportation either due to my medical condition or transportation itself.\n\nI acknowledge that no guarantees have been made to me as to the results of medical care provided.\n\nI certify that this form has been explained to me and have had the opportunity to ask questions about this form which have been answered satisfactorily.\";s:2:\"hn\";s:2153:\",             ( )       \n                                                           \n\n                                \n                \n\n                            \";s:2:\"kn\";s:2287:\",  {amb_services}          .\n                   .               .\n\n               .\n\n          .\n\n               .\";}', '0'),
(3, 'Consent for restraint during transport', 'a:3:{s:2:\"en\";s:370:\"I agree and give my consent on behalf of the patient to the use of restraints as deemed necessary by the medical personnel in the ambulance during transport to the hospital.\n\nThe need for restraints have been fully explained to me and have had the opportunity to ask questions about the nature of restrains and their need which have been satisfactorily answered.\";s:2:\"hn\";s:897:\"                               \n\n                                  \";s:2:\"kn\";s:933:\"                .\n\n                 .\";}', '0'),
(4, 'Third person Consent for treatment and transport to Government/ Trust hospital', 'a:3:{s:2:\"en\";s:985:\"I, voluntarily agree and give my consent on behalf of the patient to be treated and transported to the nearest appropriate Government/Trust hospital by {amb_services} ambulance service.\n\nI also provide my consent to the provision of all medical treatment on scene and en route to the hospital that would be judged appropriate for me by the medical personnel on the ambulance for the patient. I have been informed and understand the risks that may arise on scene and en route to hospital due to the patients medical condition.\n\nI also understand that risks may not have been discussed due to urgent nature for transportation either due to the patients medical condition or transportation itself.\n\nI acknowledge that no guarantees have been made to me as to the results of medical care provided.\n\nI certify that this form has been explained to me and have had the opportunity to ask questions about this form which have been answered satisfactorily.\";s:2:\"hn\";s:2312:\",                      /           \n\n                                                               \n\n                                 \n                 \n\n                               \";s:2:\"kn\";s:2419:\",          {amb_services}      /    .\n\n                 .              .\n\n               .\n\n          .\n\n                 .\";}', '0'),
(5, 'Third Party Consent for treatment and transport to Private hospital', 'a:3:{s:2:\"en\";s:965:\"I, voluntarily agree give my consent on behalf of the patient to be treated and transported to the nearest appropriate Private hospital by {amb_services} ambulance service.\n\nI also provide my consent to the provision of all medical treatment on scene and en route to the hospital that would be judged appropriate for me by the medical personnel on the ambulance for the patient. I have been informed and understand the risks that may arise on scene and en route to hospital due to patients medical condition.\n\nI also understand that risks may not have been discussed due to urgent nature for transportation either due to patients medical condition or transportation itself.\n\nI acknowledge that no guarantees have been made to me as to the results of medical care provided.\n\nI certify that this form has been explained to me and have had the opportunity to ask questions about this form which have been answered satisfactorily.\";s:2:\"hn\";s:2188:\",                 ()          \n\n                                                           \n\n                                \n                \n\n                            \";s:2:\"kn\";s:2403:\",        {amb_services}       .\n\n                     .               .\n\n         .     .\n\n          .\n\n                .\";}', '0'),
(7, 'Refusal for treatment and/or transport', 'a:3:{s:2:\"en\";s:726:\"I am voluntarily refusing treatment and /or transport to the hospital by {amb_services} ambulance service.\n\nI acknowledge that the seriousness of my condition as well as need for treatment and transport to the hospital has been fully explained to me by the medical personnel on the ambulance. . I have been informed and understand the risks that may arise due to lack of medical care.\n\nI will not hold the ambulance service or ambulance personnel responsible for any change in my medical condition that might arise after departure of the ambulance.\n\nI certify that this form has been explained to me and have had the opportunity to ask questions about this form which have been answered satisfactorily.\";s:2:\"hn\";s:1708:\"          /       \n\n                                                \n\n                            \n\n                        ,        \";s:2:\"kn\";s:1910:\" {amb_services}       /   .\n\n                 . .          .\n\n           ,     .\n\n               .\";}', '0'),
(8, 'Third party Refusal for treatment and/or transport', 'a:3:{s:2:\"en\";s:775:\"I am on behalf of the patient voluntarily refusing treatment and /or transport to the hospital by {amb_services} ambulance service.\n\nI acknowledge that the seriousness of the patients condition as well as need for treatment and transport to the hospital has been fully explained to me by the medical personnel on the ambulance. I have been informed and understand the risks that may arise due to lack of medical care.\n\nI will not hold the ambulance service or ambulance personnel responsible for any change in the patients medical condition that might arise after departure of the ambulance.\n\nI certify that this form has been explained to me and have had the opportunity to ask questions about this form which have been answered satisfactorily.\";s:2:\"hn\";s:1763:\"              ()         \n\n                                          \n\n                             \n\n                       ,        \";s:2:\"kn\";s:1935:\"     {amb_services}      /   .\n\n                .         .\n\n              . \n\n\n               .\";}', '0');
INSERT INTO `ems_mas_default_ans` (`ans_id`, `ans_que_id`, `ans_answer`, `ansis_deleted`) VALUES
(1, 157, 'a:3:{s:2:\"en\";s:204:\"You can call for an ambulance in case of a medical or trauma emergency.\r\nEg when a person is unconscious, has chest pain, has difficulty in breathing, is in severe pain, and has an accident or major trauma\";s:2:\"hn\";s:634:\"                \r\n         ,     ,       ,     ,        \";s:2:\"kn\";s:622:\"        .\r\n   ,  ,   ,   ,      \";}\r\n', '0'),
(2, 158, 'a:3:{s:2:\"en\";s:22:\"This is a free service\";s:2:\"hn\";s:58:\"    \";s:2:\"kn\";s:53:\"  \";}', '0'),
(3, 159, 'a:3:{s:2:\"en\";s:136:\"The patient will be assessed by the trained staff in the ambulance and will be transported to the nearest possible appropriate hospital.\";s:2:\"hn\";s:302:\"                 \";s:2:\"kn\";s:333:\"           .\";}', '0'),
(4, 160, 'a:3:{s:2:\"en\";s:44:\"No we do not transport across state borders.\";s:2:\"hn\";s:130:\",         \";s:2:\"kn\";s:106:\"   .\";}', '0'),
(5, 161, 'a:3:{s:2:\"en\";s:530:\"Patient Transfer Ambulance :-\r\n\r\n	This is a very basic ambulance that does not house an EMT but has a trained First responder.\r\n\r\n\r\n	Basic Life Support Ambulance :-\r\n\r\n	This is a Middle level patient care Ambulance. This ambulance houses an EMT- Basic who is trained to handle majority of the life-threatening conditions.\r\n\r\n\r\n	Advanced Life Support Ambulance :-\r\n\r\n	This is an Advance ambulance. This ambulance houses a Paramedic [EMT-A] who is trained to handle all life threatening conditions and perform life saving skills. state borders.\";s:2:\"hn\";s:1387:\"  : -\r\n\r\n           ,      \r\n\r\n\r\n   : -\r\n\r\n            - ,   -          \r\n\r\n\r\n   : -\r\n\r\n         [-]                        \";s:2:\"kn\";s:1566:\"  : -\r\n\r\n              .\r\n\r\n\r\n   : -\r\n\r\n     .   EMT-          .\r\n\r\n\r\n   : -\r\n\r\n   .    [EMT-A]  ,            .  .\";}', '0'),
(6, 162, 'a:3:{s:2:\"en\";s:69:\"Every ambulance has personnel trained in emergency medicine on board.\";s:2:\"hn\";s:244:\"             \";s:2:\"kn\";s:190:\"      .\";}', '0'),
(7, 163, 'a:3:{s:2:\"en\";s:82:\"You can contact 108 number or visit our website to get yourself registered.\";s:2:\"hn\";s:246:\" 108                   \";s:2:\"kn\";s:262:\" 108         ..\";}', '0'),
(9, 164, 'a:3:{s:2:\"en\";s:293:\"Once registered your medical history will be saved with us which will be helpful for our paramedics when they treat you. Also your address will be stored in the system which will enable us to dispatch the ambulance in situations where you have called the service but are unable to communicate.\";s:2:\"hn\";s:800:\"          ,        ,                ,                   \";s:2:\"kn\";s:839:\"               .                  .\";}\r\n', '0'),
