(22, 165, 'a:3:{s:2:\"en\";s:311:\"You can register yourself as a volunteer from our website. We will train you to provide first aid to patients till the ambulance arrives on scene. In case of any emergency call comes from your area of residence, a call will be given to you as well so that you can reach before the ambulance and start first aid.\";s:2:\"hn\";s:932:\"                                                ,                   \";s:2:\"kn\";s:791:\"    .          .       ,          .\";}\r\n', '0'),
(23, 183, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>Onset and duration.</li><li>History and description of seizures.</li><li>Medications and compliance.</li><li>History or evidence of trauma, particularly head trauma.</li><li> History of diabetes, headache, recreational drug or alcohol use, pregnancy.</li><li>Level of consciousness.</li><li>Ongoing seizure activity.</li><li>Incontinence.</li><li>Focal neurologic signs.</li></ul></div><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Inform History & Baseline vitals</li><li>If the patient is seizing, left lateral position with SOS suction of Airway.</li><li>Inj. Diazepam/ Midazolam 2mg IV/IM every 5-10 min up to maximum of 10mg (Dose-response titration)</li><li>Reassessment after each dose</li><li>Watch for respiratory depression ,Consider advanced airway techniques.</li><li>O2, 6 Liters / minute</li><li>If patient pregnant consider eclampsia protocol</li><li>If, GRBS <80mg/dL consider hypoglycemia  protocol.</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>Dont force things into seizing patients mouths.</li><li>Seizures may be caused by arrythmias, particularly in patients over 50.</li><li>Seizure activity may be caused by cerebral hypoxia from cardiac arrest, always check a pulse when seizures terminate.</li><li>Seizures in pediatric patients are commonly febrile seizures and are usually benign and short lived.</li><li> Pregnant women who seize may be eclamptic, treat using the Preeclampsia/Eclampsia Protocol</li></ul></div></div>', '0'),
(24, 184, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>History: Mechanism of injury, Level of Consciousness changes.</li><li>Past medical history.</li><li>Protective devices:  helmet or seat belts.</li><li>Evaluate airway patency, breathing capability, and gross injuries to extremities and trunk.</li><li>Document Glasgow Coma Scale (Document all 3 component scores, as well as the total: Eyes, Verbal, and Motor).</li><li>Pupil position and response to light stimulation.</li><li>External evidence of head trauma, (e.g., blood from ears, or scalp lacerations).</li></ul></div><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Apply C collar,</li><li>spine board-Log roll the patient and check for back injuries</li><li>Inform History & Baseline vitals</li><li>If SBP<90 or HR>100,NS 200ml IV</li><li>Reassessment after each bolus</li><li>Assessment of neurovascular function</li><li>Do not pack ear or nose bleed in the field</li><li>Hyperventilation in case of signs of increased ICP or herniation syndrome</li><li>Rapid transport</li><li>Routine use of Mannitol is not recommended without radiological evidence</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>Note changes in the patients GCS score in relation to time intervals.</li><li>Always consider cervical spine injury in patients with head trauma.</li><li>Head injury does not cause shock in adults. If shock is present in an adult patient with head trauma, consider that there is probably another cause of shock.</li><li>Head injury can cause shock in infants.</li><li>Other causes of alteration of level of consciousness should be ruled out.</li><li>Hypoventilation can cause cerebral edema.  Maintain rate of 8 breaths per minute or, if using capnography, maintain CO2 35-45.</li><li>If signs of cerebral herniation (extensor posturing, dilated or nonreactive pupils, or decrease in GCS of >2 if the initial was <9) Hyperventilation (rate 20 bpm)</li></ul></div></div>', '0'),
(25, 185, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>Sudden collapse or gradual development?</li><li>Exercise induced?</li><li>Previous history of hyperthermia?</li><li>Environmental conditions.</li><li> Vital signs:  Oral temperature (if available) of 106 degrees (41 degrees C) or greater.  If available, rectal temperature may be obtained.</li><li>Skin temperature, presence or absence of sweat. As hyperthermia progresses, the skin becomes hot and dry which indicates a failure of the normal sweat cooling mechanism.</li></ul></div><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Inform History & Baseline vitals</li><li>If SBP<90 or HR>100,NS 200ml IV </li><li>Repeat PRN\r\n Reassessment after each dose</li><li>Consider advances airway techniques</li><li>If, GRBS <80mg/dL consider hypoglycemia  protocol for known Diabetic patient</li><li>Place ice pack on : neck , groin, axillae</li><li>Cold Sponging</li><li>Turn on A/C  in ambulance </li><li>If, convulsions then, consider convulsion  protocol</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li> Heat stroke is a medical emergency.  Heat stroke is hyperthermia with altered mental status.\r\nHeat stroke is more serious than simple heat cramps or heat exhaustion (hypovolemia related to gradual fluid loss).  Be aware that heat exhaustion can progress to heat stroke.</li><li>Suspect hyperthermia in patients with acute psychosis or seizures on a hot, humid day.</li><li> Wet sheets wrapped over a patient without good air flow will tend to increase temperature and should be avoided.</li><li>Definitive cooling may require an ice water bath. Do not let cooling in the field delay your transport.  Cool patient if possible while en route.</li></ul></div></div>', '0'),
(27, 186, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>Sudden collapse or gradual development?</li><li>Exercise induced?</li><li>Previous history of hyperthermia?</li><li>Environmental conditions.</li><li>Vital signs:  Oral temperature (if available) of 106 degrees (41 degrees C) or greater.  If available, rectal temperature may be obtained.</li><li>Skin temperature, presence or absence of sweat. As hyperthermia progresses, the skin becomes hot and dry which indicates a failure of the normal sweat cooling mechanism.</li></ul></div><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Inform History & Baseline vitals</li><li>If SBP<90 or HR>100,NS 200ml IV \r\n May consider Inj. Paracetamol IM Reassessment after each dose \r\n</li><li>Consider advances airway techniques</li><li>If, GRBS <80mg/dL consider hypoglycemia  protocol</li><li>Place ice pack on :neck ,groin,  axila</li><li>Sponging</li><li>Temperature every 10 min until T<102</li><li>Turn on A/C  in ambulance </li><li>If, convulsions then, consider convulsion  protocol</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>It  is a medical emergency.It is hyperthermia with altered mental status.\r\nIt is more serious than simple heat cramps or heat exhaustion (hypovolemia related to gradual fluid loss.\r\n</li><li>Suspect hyperthermia in patients with acute psychosis or seizures on a hot, humid day.\r\nWet sheets wrapped over a patient without good air flow will tend to increase temperature and should be avoided.</li><li>Definitive cooling may require an cold water bath. Do not let cooling in the field delay your transport.  Cool patient if possible while en route.</li></ul></div>', '0'),
(28, 187, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>History of hypertension or other medical problems.</li><li>Medication use or drug ingestion.</li><li>Signs or symptoms of end organ damage such as headache, blurred vision, focal neurologic deficit, chest pain, congestive heart failure</li></ul></div><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Inform History & Baseline vitals\r\nPROPPED UP POSITION\r\nOxygen @ 6 liters/ minute \r\nIV NS maintenance\r\nRoutine use of Inj. Lasix and  Tab. SL Sorbitrate/  Tab. Amlodepin is not recommended </li><li>Closely monitor blood pressure.</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>Hypertensive emergency is only treated if signs and symptoms of end organ damage are present and DBP>115.</li><li>Patients who appear to be having a stroke (focal neurological signs) usually do not have their\r\nBP treated unless the Systolic BP is >220 mm Hg or the Diastolic BP is >120 mm Hg.</li></ul></div></div>', '0'),
(29, 188, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>Length of exposure.</li><li>Environmental conditions.</li><li>Observe for respiratory effort, pulses.</li><li>Assess cardiac rhythm.</li><li>Determine level of consciousness by verbal and motor responsiveness.\r\nMild to Moderate Hypothermia (90o-95o F)\r\nCore body temperature (if available) is less than 95 o F but greater than 90 o F. Patient may present with a history of exposure to cold, altered mental status, shivering, stiffness of muscles, stumbling or staggering gait, cool or cold skin, or mottled/pale skin.\r\nSevere Hypothermia (less than 90o F)\r\nCore body temperature (if available) is less than 90o F. Patient may present with any of the above symptoms listed above except shivering, and they may also present with absent or difficult to detect respiratory effort, and/or peripheral pulses, respiratory and/or cardiac arrest.\r\n</li></ul></div><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Inform History & Baseline vitals</li><li>Consider advances airway techniques</li><li>If, GRBS <80mg/dL consider hypoglycemia  protocol</li><li>Place heat pack on : neck, groin, axilla</li><li>Temperature every 10 min </li><li>Turn on heater  in ambulance </li><li>Turn on heater  in ambulance </li><li>Treat associated conditions</li><li>Treat cardiac problems and cardiac arrest as per normothermic protocols.</li><li>Warmed IV fluid may be necessary, and give as bolus therapy (250-500 ml in normal adult; 20 ml/kg in paeds), with repeating once if necessary. Use normal saline heated to 104-108F (40-42C) if available.</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>Handle patient gently - do not jostle. (May trigger cardiac arrhythmia: specially ventricular fibrillation) </li><li>Do not force oral intubation.</li><li>Do not intubate by nasotracheal route.</li><li>Do chest compressions only if chest is compressible and patient has a disorganized rhythm.</li><li>If terrain is difficult, evacuate patient first and treat second.\r\nIn cases of severe hypothermia, there is some evidence to suggest that metabolism of antiarrhythmic drugs is slowed, which could lead to accumulation of drugs to toxic levels..\r\n\"A patient is not dead until, they are warm and dead\"</li></ul></div>', '0'),
(30, 189, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>Scene safety-Do not enter an area that is possibly contaminated with a hazardous material unless properly protected.  Do not enter scene if physical danger is present.  Wait for police and/or hazardous materials units to clear or secure a dangerous scene.</li><li>Type of ingestion:  What, when and how much was ingested? Bring the poison, the container, and everything questionable in the area with the patient to the ED.  Look for multiple patients with same signs and symptoms.</li><li>Reason for ingestion: Screen for child neglect, and/or suicidal problem.</li><li>Past history:  Medications, diseases, psychiatric history, and/or drug abuse.</li><li>Action taken by bystanders:  Induced emesis, antidote given.</li><li>Level of consciousness.</li><li>Breath odor.</li><li>Neurologic status, pupillary findings</li><li>Vomitus.</li><li>Needle marks or tracks.</li><li>SLUDGES (Salivation, Lacrimation, Urination, Defecation, Gastric Emesis, and Sweating).\r\nThese symptoms are consistent with cholinergic poisoning.\r\n</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>Inhalation poisoning is particularly dangerous to rescuers. Recognize an environment with continuing contamination and extricate rapidly by properly trained and equipped personnel.</li><li>Do not induce vomiting.</li></ul></div><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><p>EM treatment is a priority over legal obligations</p><li>Inform History & Baseline vitals\r\nABC, if required CPR \r\nAirway / Ventilatory support\r\n</li><li>If SBP<90 or HR>100,NS 200ml IV</li><li>Reassessment after each bolus </li><li>Assessment of neurovascular function</li><li>Watch for any neurological deficits</li></ul></div></div></div>', '0'),
(31, 190, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Inform History & Baseline vitals</li>If SBP<90 or HR>100,NS 200ml IV</li><li>Reassessment after each bolus \r\n</li><li>Consider RT insertion after assessing type of poison (Avoid RT insertion in corrosive poison)</li><li> Activated charcoal 1gm/kg PO.  Avoid in patients without gag reflex</li><li>Attempt stomach-wash if less than an hour since consumption, avoid if corrosive poisoning \r\nConfirm administration of PAM in patients of OPP, in case of inter facility transfers.</li><li>If  Organophosphorus poisoning (OPP) then consider Inj. Atropine bolus until signs of atropinization are evident (Drying of secretions and pupillary dilations.)</li><li>Watch for any neurological deficits\r\nRoutine use of anti-emetics is not recommended</ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>involve police.</li><li>Protect yourself and other EMS personnel.</li><li>Initiate patient care only when the scene is safe.</li><li>Preserve the scene as much as possible:<ol type=\"a\"><li>Observe and document anything moved;</li><li>Leave gunshot or stabbing holes intact if possible;</li><li>If something must be moved, notify investigating officers and document your actions.</li></ol></li><ol type=\"A\"> <li>Documentation </li><ul class=\"style1\"><li>Report to police</li><li>Make report in duplicate</li><li>Make acknowledgement by police</li><li>Retain your copy for records</li></ul><li>B. Mention following things in report to police</li><ul class=\"style1\"><li>Name (if known)</li><li>At least two identification marks over exposed parts</li></li> Address (if Known)</li><li>Person accompanying (in case of police write name, number, rank, and police station)</li><li>From where the patient is brought</li><li>Cause of injury stated by patient or accompanying person</li><li>Injury present (nature, extent , location)</li><li>Consciousness status when saw/brought</li><li>Vital signs</li><li>Time and date\r\nProvision of death certificate - </li><li>EMS personnel do not issue death certificate so advise to conduct appropriate formality like post mortem or to get death certificate from relevant authority.\"\r\n</li></ul></ul></div></div>', '0'),
(32, 192, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>History of pregnancy: Due date, last menstrual period, is this a known multiple gestation?</li><li> Does the patient feel that she is in labor or about to deliver (e.g. rectal or vaginal pressure)?</li><li>Recent symptoms such as pain or contractions?  Timing and regularity? Vaginal bleeding, ruptured membranes, urge to push?</li><li>Medical history:  medications, medical problems, age, number of prior pregnancies.</li><li>Vital signs and fetal heart rate if possible.</li><li>Contractions and relaxation of uterus.</li><li>Where privacy is possible, inspect perineum for vaginal bleeding or fluid (note color and presence of meconium), crowning (check during contraction), abnormal presentation (foot, arm, cord, or breech).</li></ul></div><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>nform History & Baseline vitals</li><li>Do not delay suction.</li><li>Clear mouth and then nose</li><li>Taking breaths and cyanosedgive oxygen/ suction</li><li>Cyanosis persistent- BVM</li><li>Assess heart rate after 30 sec of BVM- HR < 60/min start compressions</li><li> Assessment of neurovascular function</li><li>APGAR score</li><li>Reassessment of mother after delivery</li><li>Rapid transport\n</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>Do not delay transport particularly for patients with previous  aesarean section, known imminent multiple births, abnormal presenting parts, excessive bleeding, and premature labor.\nElevated presenting body part to relieve pressure on the cord and keep the cord moist with saline gauze if it is exposed.  Do not delay transport.</li><li>If thick meconium is present, aggressively suction and consider intubation for neonate.</li><li>If a non-viable premature fetus is delivered and the fetus is available, place the fetus in a clean container and transport to the hospital with the mother. Remember to treat the fetus with the same respect as you would treat any deceased patient.</li></ul></div></div>', '0'),
(33, 193, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>Symptom onset.</li><li>Associated symptoms, such as abdominal pain, diarrhea, and headache.</li><li> If vomiting, is there any blood or coffee-ground like material in the vomitus.</li><li>History of ingestion of potential poison or spoiled food.</li><li>If female of child-bearing age, is the patient pregnant?</li><li>History of recent head injury.</li><li>Signs of dehydration (poor skin turgor, dry mucous membranes).</li><li> Jaundice.</li><li>Evidence of head trauma.</li><li>Abdominal tenderness, guarding, rigidity, bowel sounds, and distention.</li><li>Neurologic exam: level of consciousness, pupils, and focal findings.</li></ul></div><div class=\"madv_ans\"><h2>Treatment includes correction of volume depletion.</h2><ol start=\"1\"><li>Give comfortable position.</li><li>If signs of dehydration or hypotension, establish large bore IV.</li><li>When using narcotics for pain control or when pain alone seems to trigger vomiting, consider the use of antiemetics.</li></ol><ol type=\"a\"> <li>Ondansetron 4 mg IV, may repeat in 15 minutes if needed. Cardiac monitoring w/f arrhythhmia</li><li>Peds:  50 to 150 microgram/kg IV, and contact ERCP if repeat dosing needed.</li><li>w/f re-gurgitation/ vomitus in the mouth in case of unconscious patient.</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>Ondansetron may be used in cases of nausea to prevent vomiting.</li><li>Ondansetron may be used to prevent nausea when administering morphine, especially if there is a history of nausea after receiving narcotics.</li></ul></div></div>', '0'),
(34, 194, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>Approximate temperature of water.</li><li>Associated trauma.</li><li>History of scuba diving.</li><li>Resuscitation history, if applicable:  time of arrest, bystander CPR, other interventions.</li><li>Neurologic status.</li><li>Respiratory distress.</li></ul></div><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Inform History & Baseline vitals</li><li>Consider advances airway techniques</li><li>If, GRBS <80mg/dL consider hypoglycemia  protocol for known diabetic patient</li><li>Place heat pack on : neck, groin, axilla</li><li>Temperature every 10 min / watch for hypothermia</li><li>Turn on heater  in ambulance, if available \r\nw/f pulmonary oedema</li><li>Treat associated conditions</li><li>If no breathing and circulation, then follow CPR guidelines</li><li>w/f head injury/ c spine injury/ other injuries\r\n</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>If patient is still in water, rescue by trained, equipped personnel only.</li><li>Near drowning patients are likely to vomit, use caution and protect the airway.</li><li>All near drowning patients should be transported.  Patients may appear well initially, but rapid deterioration can occur. Monitor closely for pulmonary edema.</li><li>Consider that patient may be hypothermic.</li><li>It is a common error to underestimate injuries in near-drowning from diving, jumping, MVC, etc.\r\n</li></ul></div><div class=\"madv_ans\"><h2>Note:</h2><ul><div class=\"iden_mark\">* drowning is death immediately/ within 24 hrs from suffocation, by submersion in a liquid normally fresh water or sea water.</div><p>* Near drowning is survival for more than 24 hrs (even if temporary) from suffocation by submersion</p></ul></div></div>', '0'),
(35, 195, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>Type of bite/sting and description of creature, rabies status of creature.</li><li>Timing, location, size of bite/sting.</li><li>Previous reaction to bite/sting.</li><li>Rash, wound, soft tissue swelling, redness, amount of pain.</li><li>Evidence of allergic reaction such as itching, hives, difficulty breathing, wheezing, hypotension or shock.</li></ul></div><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Inform History & Baseline vitals\r\nConsider early airway interventions\r\nRemove the stinger using a straight edge, wash affected area with soap and water.\r\nIf Anaphylaxis follow Anaphylaxis protocol\r\n</li><li>Adrenaline 0.3mg (0.3mL of 1:1000)IM</li><li>May repeat up to 2X every 5 minutes PRN</li><li>Fluid challenge: 200mL NS IV bolus</li><li>InjChlorpheneramine maleate 1 amp (22.75 mg/ml) IM stat \r\nIV steroids Dexamethasone/ Hydrocordisone\r\n</li><li>If wheezing present: salbutamol 5mg nebulizer</li><li>Pain management protocol</li><li>Rapid Transport\r\n\r\nIn scorpion bite- Tab. Prazosin 30ug/kg orally every 6 hrs.\r\nLocal inj. Lignocaine and ice packs reduce pain and also slow the absorption of toxin due to vasoconstriction.\r\n</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>Human bites have higher infection rates than animal bites due to normal mouth bacteria.</li><li>Spider bites tend to be minimally painful at first, but over a few hours patients develop severe muscular pain and abdominal rigidity.</li><li>Spider bites are minimally painful, but progress to tissue necrosis over the course of a few days.</li><li>Jellyfish stings can be very painful.  Treat by flushing the skin with salty ocean water and carefully removing any visible tentacles with tweezers.  Do not use freshwater to flush the skin\r\nas this will cause undischarged nematocysts to rupture and release their toxins.</li><li>Stingray spine punctures can be extremely painful.  Impaled barbs should be left in place for transport. The wound can be immersed in non-scalding hot water to tolerance for 30 minutes\r\nwhich denatures the heat labile venom of the stingray.\r\n</li><li>While identification of the creature is important, remember that safety of the EMSO is more important than killing and/or identifying the creature.  Consider taking a photo of the creature to\r\nshow to the receiving physician if a camera is available to you.\r\nScorpion Sting- Clinical Score of Scorpion envenoming & corresponding T/t\r\n</li></ul></div></div>', '0'),
(36, 196, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>Pain:  PQRST-Place, Quality, Radiation, Severity, and Time Began.</li><li>Symptoms:  Nausea, vomiting (bloody or coffee-ground), diarrhea, constipation, melena, rectal bleeding, urinary difficulties, or fever.</li><li>History:  Previous trauma, abnormal ingestion, medications, known disease, surgery, menstrual history, possibility of pregnancy.</li><li>Abdomen:  Tenderness, guarding, rigidity, bowel sounds, distention, pulsating mass, evidence of rectal bleeding. measure girth of abdomen for distension, at the initiation of the transport and before handing over the patient to the hospital facility. \r\n</li></ul></div><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Inform History & Baseline vitals\r\nKeep the patient NBM</li><li>If SBP<90 or HR>100,NS 200ml IV</li><li>Reassessment after each bolus</li><li>Consider tramodol 25-50mg IV PRN severe pain may repeat X 1after 15 min PRN for continuing pain</li><li>Ranitidine 50mg IV (Slow IV, w/f conduction disturbances)\r\n Reassessment after each dose\r\n</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>Abdominal pain may be the first warning of catastrophic internal bleeding leading to hemorrhagic shock.  Maintain a high index of suspicion and monitor for early signs of shock.</li><li>Use caution with fluid administration in patients with suspected dissecting aortic aneurysm.  Do not try to exceed systolic BP of 90 mmHg.</li></ul></div></div>', '0'),
(37, 197, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>Pain:  PQRST-Place, Quality, Radiation, Severity, and Time Began.</li><li>Symptoms:  Nausea, vomiting (bloody or coffee-ground), diarrhoea, melaena, rectal bleeding, urinary difficulties, or fever.</li><li>History:  Previous trauma, abnormal ingestion, medications, known disease, surgery, menstrual history, possibility of pregnancy.</li><li> Abdomen:  Tenderness, guarding, rigidity, bowel sounds, distention, pulsating mass, evidence of rectal bleeding.</li><li>Number of episodes of vomiting, loose motions in the past 24 hrs</li><p>Note history suggestive of food poisoning</p><p>Note signs of Dehydration- low Pulse, low BP, loss of skin turgor, sunken eyes</p></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>Abdominal pain</li></ul></div><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Inform History & Baseline vitals</li><li>If SBP<90 or HR>100,NS, Bolus 200ml watch for urine output and then continue</li><li>Reassessment after each bolus(be careful about elderly)</li><li>Inj. Ondansetron SOS</li><li>If, GRBS <80mg/dL consider hypoglycaemia  protocol</li><li>Monitor BP and skin  every 10 min until signs of rehydration</li><li>Inquire about other cases having similar complaints in the area(endemic/epidemic)</li><li>If poisoning cases then inform PDA</li></ul></div></div>', '0'),
(38, 198, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>Allergen exposure and route of exposure.</li><li>History and type of previous allergic reactions.\r\nSymptoms:</li><li>Pruritus, dyspnoea, sensation of airway closure, generalized weakness or dizziness.</li><li>Skin:  Hives, swelling, or erythema.</li><li>Airway: Oropharyngeal oedema, drooling.</li><li>Pulmonary: Wheezing, stridor, hoarseness, inability to speak</li><li>Cardiovascular:  Hypotension.\r\n(Airway compromise & haemodynamic instability would indicate anaphylaxis- is there a need to mention the above in allergic reactions?)\r\n</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Inform History & Baseline vitals</li><li>Oxygen + Consider advances airway techniques</li><li>Fluid challenge: 200ml NS IV bolus repeat SOS</li><li>Inj. Chlorpheniramine maleate 1 amp (22.75 mg/ml) IM/IV stat</li><li>If wheezing present: Salbutamol 5mg via nebulizer (Not available in the ambulance- salbutamol inhaler without spacer available)</li><li>Inj .Dexamethasone (8mg) IV or Inj. Hydrocortisone(100mg) IV\r\n</li></ul></div></div>', '0'),
(39, 199, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li> Last time seen conscious or normal, progression of symptoms, recent symptoms such as headache, seizure, confusion, or trauma.  Medical problems and medication history, toxin exposure, history of seizure or stroke.</li><li> Psychiatric problems, recent crisis, bizarre or abrupt changes in behavior, suicidal ideas, alcohol/drug intoxication, psychotropic or behavioral drugs.</li><li>Surroundings: Bring pill bottles, syringes etc., with patient.  Note any peculiar odors in environment.</li><li>Pupils: Size, symmetry, and reactivity.</li><li> Mental status:  Altered mental status includes not only unconsciousness or confusion, but also irrational activity such as verbal attacks, spitting, or combativeness.  Note level of consciousness and neurologic status. Document GCS if applicable.</li><li> Look for signs of trauma, evidence of drug / narcotic substance use such as needle tracks.</li><li>Characteristic odour on patients breath.</li><li>H/O DM/ HTN</li><li>Confirm H/O Animal/ Dog bites (rabies)</li><li>Remember metabolic and Organic causes for AMS</li></ul></div><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Inform History & Baseline vitals</li><li>Oxygen & Manage Airway</li><li>If blood glucose less than 80 mg/dL administer Dextrose 25 gm (50 ml of 50% solution) IV</li><li>Naloxone (Narcan) 0.1  2 mg IV, IO, IM or intranasal (may opt to give 2 mg as starting dose if using intranasal route) only give if respirations less than 12 per minute and you suspect narcotic overdose. (first  confirm availability from the EMSO attending that specific call)</li><li>Watch for acute narcotic withdrawal symptoms</li><li>Glucagon 1 mg IM (if IV unavailable for administration of Dextrose)</li><li>Do not sedate</li><div class=\"font_weight600\">Note:</div><p>ERCPs to read Narcan, Thiamine, Glucagon literature.</p></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>In cases of dangerous environment, safety of personnel on scene is paramount.</li><li> If there are multiple patients, suspect poisoning.</li><li>Be particularly attentive to airway management.  Aspiration of secretions, vomiting, and inadequate ventilations may be present in patients with severely altered mental status.</li><li>Hypoglycaemia may present as focal neurologic deficit or altered mental status, particularly in elderly patients.</li><li>All patients treated using this protocol should have a medical evaluation and should not be considered or referred to as a psychiatric patient unless under a bona fide mental health hold by a physician, mental health professional, or law enforcement officer.  Medical causes of altered mental status should be considered first before psychiatric causes of altered mental status.</li><li>CAUTION: Suicidal patients and patients with hallucinations or delusions may potentially exhibit violent behaviour.</li></ul></div></div>', '0'),
(40, 200, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>Allergen exposure and route of exposure.</li><li>History and type of previous allergic reactions.</li><li> Symptoms: pruritus, dyspnoea, sensation of airway closure, generalized weakness or dizziness.</li><li>Airway: Oropharyngeal oedema, drooling.</li><li>Pulmonary: Wheezing, stridor, hoarseness, ability to speak</li><li>Skin:  Hives, swelling, or erythema.</li><li>Cardiovascular:  Hypotension.</li></ul></div>\r\n<div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Inform History & Baseline vitals</li><li>Oxygen/ Manage airway</li><li>IV 200ml bolus and then repeat SOS</li>Inj. Avil 45.5mg IM OR 45.5mg in 8cc NS slow IV</li><li>Inj. Hydrocortisone(100mg) OR\r\nInj. Dexamethasone(8mg) IV</li><li>Inj. Adrenaline 0.3 to 0.5 ml SC/ IM</li><li>Inj. Deriphylline slow IV</li></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>Anaphylaxis is a severe, potentially life-threatening allergic reaction that can develop rapidly. (http://www.nhs.uk/conditions/Anaphylaxis/Pages/Introduction.aspx)</li><li>Epinephrine is associated with many adverse reactions including hypertension, tachycardia, arrhythmias, tremor, anxiety, vomiting, and chest pain.</li><li> Epinephrine should be avoided in the elderly, in patients with known coronary artery disease, and in patients with uncontrolled hypertension except in life-threatening allergic reactions.</li><li>The two forms of Epinephrine must not be confused or over-dosage may occur. The 1:1000 dilution is appropriate for intramuscular injection. The 1:10,000 dilution is for intravenous injection. The 1:1000 dilution is NEVER given intravenously.(except in Cardiac arrest)</li></ul></div></div>', '0'),
(41, 201, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>Type of bite and description of creature, rabies status of creature.</li><li>Timing, location, size of bite.\r\nSkin break, bruise, punctute, cuts, redness, swelling, amount of pain, bleeding.</li></ul></div><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Inform History & Baseline vitals</li><li>ABC\r\nWash wound thoroughly with soap and running water. \r\nIf pain; give Inj. Tramadol\r\nIV fluid: IV NS 200cc\r\nFor Vaccinations refer to- http://www.who.int/ith/vaccines/rabies/en/  \r\nReference- \r\nNational guidelines for management of Animal bites. html \r\nhttp://www.emedicinehealth.com/animal_bites/article_em.htm</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>Human bites have higher infection rates than animal bites due to normal mouth bacteria.</li><li> Cat bites may progress to infection rapidly due to specific bacteria in their mouths.</li><li>Carnivore bites (such as dogs) have potential for progression to infection and risk of Rabies exposure.</li><li>While identification of the creature is important, remember that safety of the EMSO is more important than killing and/or identifying the creature.  Consider taking a photo of the creature to\r\nshow to the receiving physician if a camera is available to you.</li></ul></div></div>', '0'),
(42, 202, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>Onset and timing of symptoms.</li><li>History of respiratory problems such as asthma, COPD, CHF, severe allergic reactions.</li><li>History of pulmonary embolism or clotting risk factors such as recent surgery, immobilization, cancer.</li><li>Associated symptoms such as chest pain, palpitations, peripheral oedema, fever, productive cough.</li><li> Home oxygen use.</li><li>Evidence of airway obstruction:  stridor, drooling, hoarseness, coughing, irrational behaviour.</li><li>Evidence of respiratory failure: inability to speak, weakened respiratory effort or increased work of breathing, cyanosis, decreased pulse oximetry.</li><li>Abnormal lung sounds such as crackles, wheezing, and absence of lung sounds.</li><li>Abnormal lung sounds such as crackles, wheezing, and absence of lung sounds.</li><li>Evidence of congestive heart failure such as peripheral oedema, distended neck veins, crackles on lung exam.</li><li>Evidence of trauma, suggesting possible pneumothorax or other intrathoracic injury.</li><li>Evidence of allergic reaction such as hives, airway oedema, urticaria, known exposure.</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>Determining the exact aetiology of respiratory distress can be difficult.</li><li>Children with croup, epiglottitis, or laryngeal oedema usually have respiratory arrest due to exhaustion or spasm. They can often still be ventilated with bag-valve-mask ventilation and do not require Advanced Airway placement.</li><li>Pulmonary embolism and other serious pulmonary diseases may present simply as hyperventilation with anxiety.</li><li> Equipment for airway support using rescue techniques for failed intubation attempts, such as blind insertion \r\n\r\nOf airway devices and bougies, should be readily available.</li></ul><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Inform History & Baseline vitals\r\n(Ask for K/C/O asthma- already using bronchodilators+ steroids)</li><li>Oxygen  K/C/O COPD (2 lit/min)/ Myesthenia</li><li>Consider advanced airway techniques when SPO2 <90(to check proper probe placements+ assess for haemodynamic instability)</li><li>If wheezing present: Nebulisation with Salbutamol 5mg</li><li>Pedal edema+ SOB+Past history then, Inj Furosemide 20 mg IV stat</li><li>Anaphylaxis protocol in case of allergy/anaphylaxis\r\nPneumothorax with haemodynamic instability- consider needle decompression\r\nSevere Asthma/ Stridor in children- Epinephrine nebulisation 1:1000 1 \r\n\r\nml+3ml NS \r\n<4yrs: 0.5 mg/kg via Neb(max dose 2.5 mg)\r\n>4 yrs.: (0.5 mg/ kg via Neb(max. dose 5mg)</li></ul></div></div>', '0'),
(43, 203, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>Extent of injury in electrical burns</li><li>Type of exposure - Any information concerning products involved should be collected at the scene if possible.  Note if patient was in an enclosed space and if inhalation of smoke or fumes has occurred.</li><li>Duration of exposure.</li><li>History of loss of consciousness.</li><li>Past medical history - especially cardiac or pulmonary disorders.</li><li>Identify severity of burns (superficial- reddened only; partial thickness- blistered areas; full thickness - scarred or leathery areas) and extent of burns (refer to the rule of nines).</li><li>Associated trauma - Burns associated with explosion have great potential for other injuries.\r\nConsider rapid trauma survey.</li></ul></div><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Inform History & Baseline vitals</li><li>Assess & manage ABC\r\nConsider rapid transport wherever needed. Do not delay transport for IV access.\r\nIn case of Electrocution attach Cardiac Monitor (If patient is in VT / VF follow ACLS protocols)</li><li>If SBP<90 or HR>100,NS 200ml IV bolus</li><li>Reassessment after each bolus </li><li>Consider opiods like Inj. Fentanyl 1 microgram/kg IV PRN severe pain may repeat X 1after 15 min PRN for continuing pain \r\nInj. Tramadol 50 mg IV.\r\nInj. Diclofenac(aq.) 50 mg in 100 ml IV.(Use NSAIDs with caution)\r\nLater on fluid can be given  by using formula [Fluid to be infused in first 24 hours = 4 X % area of burns X body weight in Kg] (1/2 over first 8 hours remainder over the next 16 hours)\r\n Hold Fentanyl if SBP<90 or RR<12\r\nConfirm about information to police status</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>Scene hazards - electrical wires, chemical fumes, carbon monoxide or fire. Do not attempt rescue in hazardous environment \r\nConsider exposure to smoke, toxic chemicals or fumes, potential for explosion, electrical sources, etc.</li><li>Inhalation exposure can cause airway compromise.  Note presence of stridor, facial swelling, carbonaceous sputum, singed nasal hair or drooling. Consider early endotracheal intubation to preserve the Airway.</li><li> Smoke or chemical exposure can cause bronchospasm presenting as wheezing.</li><li>Large burns will cause severe fluid loss.  Note tachycardia, signs of volume depletion and hypotension.</li><li>Carbon monoxide will cause cerebral anoxia.  Check for headache, confusion, or decreased level of consciousness, dyspnea.  Pulse oximeter gives false high reading in presence of carbon monoxide poisoning or cyanide poisoning.</li><li> Unconsciousness - always consider the possibility of occult head or cervical spine injury. Suspect the possibility of carbon monoxide exposure.</li><li> Do not induce hypothermia by applying cold or moist dressing to burned areas as the body may lose excessive heat through burned skin.</li><li>Consider the possibility of abuse when certain burns are encountered.  These include cigarette burns, iron burns, grill burns, and any burns in the elderly or children where the described mechanism of injury appears to be unlikely.</li><li>Cardiac involvement - consider the potential for myocardial injury, ischemia, and arrhythmia in any patient with electrical or inhalation injury.</li><li> Avoid initiating IVs in burned areas except in extreme circumstances.</li><li>Transport - Do not delay the transport of the seriously burned patient to administer volume boluses of fluid.  Fluid loss occurs over the course of hours.  Initiate fluids en route if burns are\r\nextensive, or the potential for airway compromise exists.</li></ul></div></div>', '0'),
(44, 204, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM - Adult</h2><ul><li>Determine level of responsiveness, quality of respiratory effort, presence of pulses.</li><p>Cardiac rhythm analysis.</p><li>Patients past medical history, medications, allergies.</li><li>Reversible causes of cardiac arrest:  Hypovolemia, Hypoxia, Acidosis, Hypokalemia, Hyperkalemia, Hypothermia, Tension Pneumothorax, Cardiac Tamponade, Toxins, Pulmonary Thromboembolism, Acute MI.</li></ul></div><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li> Keep phone in loud-speaker mode while talking to ERCP, dont stop CPR.</li><li> Please note: Minimize interruptions in CPR, Continue resuscitation (CPR) for longer durations in special scenarios (hypothermia, drowning, electrocution, in children)\r\nFollow ACLS protocols</li><li>To withhold CPR & terminate resuscitative efforts (CPR)  ERCP may need to advice when not to initiate CPR and may have to guide when to terminate the resuscitative efforts after certain time.</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>Performance of high quality chest compressions of adequate depth and rate combined with early defibrillation are the most critical elements of the resuscitation.  Interruptions in chest compressions, including pulse checks, should be minimized and should only last 5 seconds.</li><li>Once resuscitative efforts are begun, they should be continued until arrival at the receiving hospital.</li><li>Treatment decisions must be made considering the patients condition, not just the rhythm on the monitor.</li><li>Survivability of patients with chest injury and impending cardiac arrest can be increased by prioritizing fluid resuscitation & rapid transport to hospital over providing chest compressions. \r\nChest compressions may still be performed, but should not delay transport. These patients should receive IV fluids resuscitation according to the Shock protocol.</li><li>If the patient in cardiac arrest has a venous port or other central venous access device, you may use it.</li><li> If quantitative waveform capnography <10 mm Hg, attempt to improve CPR quality.</li></ul></div>', '0');
INSERT INTO `ems_mas_default_ans` (`ans_id`, `ans_que_id`, `ans_answer`, `ansis_deleted`) VALUES
(45, 205, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>Assess for Chest pain.</li><li>Associated Shortness of breath?</li><li>Look for Jugular Vein Distension</li><li>Watch for Paradoxical chest wall motion.</li><li>Observe for Tachycardia, Hypotension, Tachypnea, Tracheal deviation.</li><li>Assess for Crepitus, decreased breath sounds</li></ul></div><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Inform History & Baseline vitals</li><li>Assess and manage ABC\r\n Decompression in Tension Pneumothorax (Unilateral absence of Breath sounds/ hyper resonance on percussion, Deviated trachea)</li><li>way seal in open chest injury\r\nApply bulky dressing if flail chest</li><li> If SBP<90 or HR>100,NS 200ml IV bolus Reassessment after each bolus</li><li>Consider Opiods</li></ul></div> <div class=\"madv_ans\"><h2>MANAGEMENT</h2><ul><li>Routine trauma care</li><li>Control bleeding</li><li>IV access and fluids</li><li>C-Spine care</li><li>Wound care</li><li>Needle Decompression of tension pneumothorax</li><li>Open pneumothorax</li><li>High flow O2</li><li>Cover with 3 sided occlusive dressing</li><li>Re-evaluate for tension</li><li>Paradoxical movement/ Flail chest</li><li>Positive pressure ventilation with BVM and High flow O2</li><li>Bulky dressing</li><li>Pain control </li><li> Enroute care</li><li>Reassess the bleeding</li><li>Monitor ABC, vitals</li><li>  Control pain with painkillers after medical direction</li></ul></div> <div class=\"madv_ans\"><h2>DO NOT:</h2><ul><li>Do Not allow patient to swallow any liquid or food</li><li> Do NOT swallow blood.</li><li>Do NOT blow; cough, sniff, or pick the nose if there is bleeding.</li><li> Do NOT put any object in the ear to stop bleeding.</li><li>Do NOT take aspirin if there is any bleeding.</li><li>Do NOT remove a cloth that you have applied to stop bleeding. Add another cloth on the previous one.</li><li>Do NOT remove any penetrating object.</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><div class=\"iden_mark\">Chest wall Injuries:</div><li>Flail chest: Flail Segment is defined as two or more adjacent ribs that are fractured in two or more places\r\nRib fractures: In blunt or penetrating injuries the force applied may fracture the rib in one or more areas</li><li> Sternal Fractures: Sternum or the chest bone may get fractured due to blunt trauma. It may be associated with cardiac contusions, pulmonary contusions, myocardial tamponade etc.</li><p>Lung Injuries:</p><li>Pulmonary contusion: As the lung tissue is compressed against the chest wall by force or by positive pressure within the chest during a thoracic injury, alveolar and capillary damage occurs.</li><li>Simple pneumothorax: The presence of air within the chest cavity in the pleural space, but outside the lung (collapsed lung) is called pneumothorax. When it is not causing any pressure changes or not under tension it is called simple pneumothorax.\r\nOpen pneumothorax</li><li>Tension pneumothorax: a condition in which air continuously leaks out of the lung into the pleural space; increasing pressure within the space with every breath the patient takes.</li><li>Hemothorax: the presence of blood in the chest cavity within the pleural space, outside the lung.</li><p>Myocardial Injuries:</p><li>Pericardial tamponade: Compression of heart by accumulation of blood in pericardial space</li><li> Myocardial contusion: Due to sudden deceleration, heart collides with the posterior aspect of sternum, leading to blunt injury called myocardial contusion.</li><li> Myocardial rupture: It is an acute perforation of the ventricles, atria, intra-ventricular septum, intra arterial septum, chordae, papillary muscles or valves</li><li> Commotio cordis: If the thorax receives a direct blow during the critical portion of the hearts repolarization period may result in immediate cardiac arrest. This condition is known as commotion cordis</li><p>Vascular Injuries:</p><li>Thoracic aortic dissection/ transaction</li><p>Other injuries:</p><li>Diaphragmatic injuries</li><li>Esophageal injuries</li><li>Tracheobronchial injuries</li><li>Traumatic asphyxia: The sudden compression of chest causing translation of pressure into the major veins of the head, neck, and kidneys resulting in rupture of capillary beds is known as traumatic asphyxia.</li></ul></div></div>', '0'),
(46, 206, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>Assess Pain (Onset, Place, Quality, Radiation, Severity, Time began).</li><li> Associated symptoms:  nausea, vomiting, diaphoresis, shortness of breath.</li><li>History:  cardiac or pulmonary events, medications, syncope.</li><li>Risk Factors:  Family history, smoking, obesity, diabetes, hypertension, high cholesterol.</li><li>Vital signs no less than every 10 minutes and after each medication.</li><li> Symmetry of pulses.</li><li>Signs of Congestive Heart Failure such as neck vein distention, peripheral edema, or pulmonary edema.</li><li>Examine abdomen.</li></ul></div><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li> Inform History & Baseline vitals\r\nAssess and manage ABC \r\nO2 support\r\nAspirin  325 mg tablet (chewable)</li><li>Sorbitrate 5mg SL \r\n Hold sorbitrate if Viagra /levitate/ cialis(PDE-5) in past 36 hrs\r\n Hold sorbitrate if HR<55,>100,SBP,100\r\nHold sorbitrate in Inferior wall MI\r\n Reassessment after each dose</li><li> If non cardiac chest pain then consider fentanyl/ tramadol</li><li>Consider advanced airway techniques</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>This protocol is for adults. </li><li>Chest wall tenderness does not rule out cardiac ischemia.</li><li>Absence of ST segment changes does not rule out Chest pain of cardiac origin.</li><li>ST segment elevation MI (STEMI) can only be accurately diagnosed by acquiring a 12 lead ECG.</li><li>Have a high index of suspicion for cardiac disease in women, diabetics, and all patients >50 years old who have any symptoms that might be attributed to acute coronary syndrome (e.g. nausea, neck,\r\njaw, or arm pain, chest pain, diaphoresis, syncope).</li><li>12-Lead ECG should be performed on all patients with chest pain, epigastric discomfort, or suspected acute coronary syndrome.</li><li>In patients with STEMI, time to reperfusion is critical.  Minimize scene times when possible.\r\nConsider transporting patients with STEMI to hospital with available catheterization lab for percutaneous coronary intervention (PCI).</li></ul></div></div>', '0'),
(47, 207, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>History of pregnancy: last menstrual period, Due date, is this a known multiple gestation?</li><li>Does the patient feel the urge to push (labor e.g. rectal or vaginal pressure)?</li><li> Recent symptoms such as pain or contractions?  Timing and regularity? Vaginal bleeding, ruptured membranes, urge to push?</li><li>Medical history:  medications, medical problems, age, number of prior pregnancies.</li><li> Vital signs and fetal heart rate.</li><li>Frequency of Uterine Contractions </li><li>Where privacy is possible, inspect perineum for vaginal bleeding or fluid (note color and presence of meconium), crowning (check during contraction), abnormal presentation (foot, arm, cord, or breech).  refer abnormal presentation section</li></ul></div><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><p>Assess and manage ABC</p><ol start=\"1\"><li>O2 as appropriate, IV access NS (Maintenance dose 75 to 150 ml/hour)</li><li>Assess for uterine descent & engagement of the head into the pelvis.(False labor- Uterus still not descended)\r\nIf crowning is absent encourage mother to NOT bear down</li><li>If hypotensive, roll patient onto left hip\r\nEnquire about cervical dilatation from referring hospital\r\nEMSOs should not be encouraged to perform PV examination</li><li>inches from baby and cut between clamps \r\nDry baby, examine and keep warm (may place next to mothers skin). As soon as possible, enable child to nurse at mothers breast.\r\nAssess APGAR SCORE at 1 and 5 minutes See chart\r\nDo not externally massage the uterus en route until placenta has delivered\r\nDo not apply any cord traction\r\nDo not forcibly remove placenta\r\nIf placenta is delivered, examine for intactness, wrap and package with cord\r\nMonitor the patient and check for signs of PPH.</li><li>If babys head is delivering: Look for and reduce cord around neck. \r\nFollow Emergency child birth protocol.</li><ol><div class=\"font_weight600\">Suction neonates mouth then nose.\r\nEpisiotomy should not be performed by EMSO</div><p>Do not hurry or slow delivery\r\nIn case of difficult situations do not delay transport \r\nPost Delivery:\r\nAfter cessation of pulsations double clamp the cord at least</p></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>Do not delay transport particularly for patients with previous cesarean section, known imminent multiple births, abnormal presenting parts, excessive bleeding, and premature labor.</li><li> If thick meconium is present, aggressively suction and consider intubation for neonate. </li><li>If a non-viable premature fetus is delivered and the fetus is available, place the fetus in a clean container and transport to the hospital with the mother. Remember to treat the fetus with the same respect as you would treat any deceased patient.</li></ul></div>', '0'),
(48, 208, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>If the presenting part is the cord, apply pressure to the babys presenting part with a sterile, gloved hand to keep pressure off the cord. Raise mothers hips onto pillows. Keep cord warm. Do not clamp or cut cord\r\nDO NOT DELAY TRANSPORT.\r\nEncourage mother to NOT bear down\r\nIf hypotensive, roll patient onto left hip</li><li><div class=\"font_weight600\">In case of Breech presentation & if delivery is imminent then:</div><p>Observe for signs and symptoms for delivery</p><ol type=\"a\"><li>Prepare obstetric kit</li><li>After the anterior buttock and fetal anus are visible, lithotomy position when the posterior buttock distends the perineum.</li><li>More than one contraction in one minute Mother expresses the urge to push</li></ol><ol type=\"2\"><li>Management</li></ol><ol type=\"a\"><li> The no touch of the fetus policy is adopted until the buttocks are delivered along with the legs in flexed breech and the trunk slips up to the umbilicus.</li><li>The extended legs (in frank breech) are to be decomposed by pressure on the knees (popliteal fossa) in a manner of abduction and flexion of the thighs.</li><li>The umbilical cord is to be pulled down and to be mobilized to one side</li><li>If the back remains posteriorly, rotate the trunk to bring the back anteriorly.\r\nThe baby is wrapped with a sterile towel to prevent slipping</li><li>Delivery of the arms: The assistant is to place a hand over the fundus and keep a steady pressure during uterine contractions to prevent extension of the arms.</li><li>The arms are delivered one after the other only when one axilla is visible, by simply hooking down each elbow with a finger.</li><li>Delivery of the after-coming head: This is the most crucial stage of the delivery.\r\nMalar flexion and shoulder traction (modified Mauriceau-Smellie- Veit technique):  The baby is placed on the supinated left forearm (preferred) with the limbs hanging on either sides. The middle and the index fingers of the left hand are placed over the malar bones on either sides. This maintains flexion of the head. The ring and little fingers of the pronated right hand are placed on the childs right shoulder, the index finger is placed on the left shoulder and the middle finger is placed on the sub-occipital region. Traction is now given in downward and backward direction till the nape of the neck is visible under the pubic arch. \r\nThe assistant gives suprapubic pressure during the period to maintain flexion. Thereafter, the fetus is carried in upward and forward direction towards the mothers abdomen releasing the face, brow and lastly, the trunk is depressed to release the occiput and vertex.</li><li>NEVER TO RUSH AND NEVER TO PULL THE INFANT</li></ol><div class=\"font_weight600\">_REF: DC DUTTAs TEXT BOOK OF OBSTETRICS</div><ol type=\"3\"><li>When baby is delivered</li></ol><ol type=\"a\"><li>Wipe blood and mucus from mouth and nose suction nose and mouth again</li><li>Assure patent airway, if baby is not crying spontaneously, stimulate cry by tapping soles of feet or at back</li><li>Do APGAR assessment on infant one minute of delivery</li><li>Wrap infant in warm blanket and place on side, Head slightly lower than trunk </li><li>Keep infant level at vagina until the cord is cut </li><li>After cessation of pulsations, Double clamp, tie and cut cord between two clamps</li></ol><ol type=\"4\"><li>Record time of delivery</li><li>Let placenta deliver normally</li></ol><ol type=\"a\">Place placenta in plastic bag and transport with mother</li><li>Massage mothers lower abdomen until firm (Hard)</li><li><ol type=\"6\"><li>Place sterile pad over vaginal opening</li><ol></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>Prolapsed Umbilical cord - In case of prolapsed umbilical cord, place the mother in Trendelenburg or knee chest position.\r\nElevated presenting body part to relieve pressure on the cord and keep the cord moist with saline gauze if it is exposed.  Do not delay transport.</li><li>Breech Presentation</li><li>Do not attempt to deliver in limb presentation, transverse lie</li></ul></div>', '0'),
(49, 209, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Relevant pre hospital care as per the symptoms/ injuries</li><li>Suspect trauma and/or medical conditions in elderly patients.</li><li>Report elderly/child abuse. You will be protected by law from civil liability for making such a report if made in good faith.</li><li>Treat elderly with empathy, provide reassurance and support</li><li>Try to confirm the identity of the parent/ care-giver</li></ul></div><div class=\"madv_ans\"><h2>Look For</h2><ul><p>Broken eyeglasses</p><p>Signs of drug overdose AMS</p><p>In children -</p><p>Bruises in unusual areas like inner arms/ inner thighs </p><p>Burns- Hot water/ cigarette </p><p>Recurring injuries to face, neck or upper extremities.</p><li>Report elderly/ child abuse. You will be protected by law from civil liability for making such a report if made in good faith.</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>Reasonable cause to suspect when, while acting in a professional capacity, you suspect that an adult/ Child has been abused neglected or exploited and you have reasonable cause to suspect that the adult/ Child is incapacitated.</li><li>ted mechanism of injury/ history does not match with the presentation. \r\nLook for signs of physical abuse /sprains/ fractures/ dislocations/bruises/ burns/ abrasions/ or markings of hand grips, bites or ropes</li></ul></div></div>', '0'),
(50, 210, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li> History of pregnancy: Due date, last menstrual period, is this a known multiple gestation?</li><li> Does the patient feel that she is in labor or about to deliver (e.g. rectal or vaginal pressure)?</li><li> Recent symptoms such as pain or contractions?  Timing and regularity? Vaginal bleeding, ruptured membranes, urge to push?</li><li> Medical history:  medications, medical problems, age, number of prior pregnancies.</li><li>Vital signs and fetal heart rate if possible.</li><li>Contractions and relaxation of uterus.</li><li>Where privacy is possible, inspect perineum for vaginal bleeding or fluid (note color and presence of meconium), crowning (check during contraction), abnormal presentation (foot, arm, cord, or breech).</li></ul></div><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><p>ERCP Advice:</p><ol type=\"1\"><li> Observe for signs and symptoms for delivery </li><ol type=\"a\"><li>Perineum bulging / Baby crowning</li><li>More than one contraction in one minute</li><li> Mother expresses the urge to push</li></ol><li>Management</li><ol type=\"a\"><li>Keep the mother in supine position knees flexed and spread apart (lithotomy)</li><li>Prepare obstetric kit</li><li>When infant head appears during crowing, place fingers on bony part of skull and support the perineum to prevent explosive delivery \r\nIf there is cord loop around the neck, encourage EMSO to release the cord without cutting.</li><li>\r\nWhen head is delivered, suction infants nose with bulb syringe (mucus sucker)</li><li>Assist delivery of shoulders and body, do not pull the infant</li></ol><li>When baby is delivered</li><ol type=\"a\"><li> \r\nWipe blood and mucus from mouth and nose. Suction mouth and nose again</li><li>Assure patent airway, if baby is not crying spontaneously, stimulate cry by tapping soles of feet or at back</li><li>Do APGAR assessment on infant one minute of delivery </li><li>Wrap infant in warm blanket and place on side, Head slightly lower than trunk</li><li>Keep infant level at vagina until the cord is cut</li><li>After cessation of pulsations, Double clamp, tie and cut cord between two clamps (In case of prolonged child birth/ suspected birth asphyxia the cord is clamped and cut within 1 minute of the delivery in hospital surroundings)</li></ol><li>Record time of delivery</li><li>Let placenta deliver normally</li><ol type=\"a\"><li>Place placenta in plastic bag and transport with mother</li><li>Message mothers lower abdomen until firm (Hard)</li></ol><li>Place sterile pad over vaginal opening</li><li>Complete the ongoing assessment (complete assessment)</li><li>Estimate blood loss, if symptoms of shock are observed follow shock protocol</li><li>Contact medical direction if required</li><li>Transport to the nearest hospital</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li> Do not delay transport particularly for patients with previous cesarean section, known imminent multiple births, abnormal presenting parts, excessive bleeding, and premature labor.</li><li>In case of prolapsed umbilical cord, place the mother in Trendelenburg or knee chest position.\r\nElevated presenting body part to relieve pressure on the cord and keep the cord moist with saline gauze if it is exposed.  Do not delay transport.</li><li>If thick meconium is present, aggressively suction and consider intubation for neonate. clean container and transport to the hospital with the mother. Remember to treat the fetus with the same respect as you would treat any deceased patient.</li></ul></ol></ol></div></div>', '0'),
(51, 211, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>Vital signs- Heart rate/BP/RR.</li><li>Patient skin condition (cool/ moist/ pale)</li><li>Capillary refill time and distal PMS</li><li>Timing and mechanism of amputation.</li><li>History of bleeding disorder, including blood thinning medications.</li><li>Amount of blood loss.</li><li>Note structural attachments in partial amputations.</li></ul></div> <div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Inform History & Baseline vitals</li><li>Care of Airway, Breathing, Circulation</li><li>If SBP<90 or HR>100,NS 200ml IV\r\nReassessment after each bolus</li><li>Consider Inj. Tramadol 50 miligram  PRN severe pain</li><li>Watch for deterioration & LOC</li><li>Altered mental status protocol if needed</li><li>Care for amputated body part</li><li>Time is tissue if the extrication time is prolonged  consider the sending the amputated part  ahead to be surgically prepared for re-implantation</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>Do not immerse the amputated part in liquid or dry ice.</li><li>Time is of the greatest importance to assure viability.  If the extrication time will be prolonged, consider sending the amputated part ahead to be surgically prepared for reimplantation.</li><li>If bleeding cannot be controlled by direct pressure and elevation, a tourniquet should be applied as close as practical to the injury site.  The tourniquet should not be covered. Note on the\r\npatient the time of tourniquet application and document in the record.</li><li> If the amputated part is recovered and appears to be reimplantable, consider transport to a hospital with reimplantation capability.</li></ul></div></div>', '0'),
(52, 212, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li> History of trauma and mechanism of injury.</li><li>Localized Tenderness, Instability, and Crepitation.</li><li>Pulses, Motor Function, and Sensation.</li><li>Obvious deformity, angulation, deep lacerations, and exposed bone fragments.</li></ul><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Inform History & Baseline vitals</li><li>If SBP<90 or HR>100,NS 200ml IV</li><li>Reassessment after each bolus</li><li>Pressure dressing to control bleeding</li><li>Apply pneumatic splint if? fracture of bone</li><li>Consider Inj. Tramadol  50 milligram  PRN severe pain</li><li>Assessment of neurovascular function (PMS)</li><li>If extremity is pulseless, attempt gentle in line traction to restore normal anatomic position</li><li>If repositioning does not restore circulation, do not manipulate further</li></ul></div></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li> Fractures do not necessarily lead to deformity or loss of function, e.g., impacted fractures may cause pain but little or no deformity or loss of function.</li><li>Extremity injuries benefit from appropriate care, but are of low priority in a patient with multiple injuries.</li></ul></div></div>', '0'),
(53, 213, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>Level of consciousness.</li><li>Ongoing seizure activity.</li><li>Incontinence</li><li>Focal neurologic signs.</ul></div> <div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Inform History & Baseline vitals</li><li>f SBP<90 or HR>100,NS/ RL/ Isolyte-P  IV</li><li>Repeat PRN\r\n Reassessment after each dose </li><li>Consider advanced airway techniques</li><li>If, GRBS <80mg/dL consider hypoglycemia  protocol if known diabetic</li><li>Sponging with tepid water</li><li>Temperature every 10 min until T<102</li><li>Turn on A/C  in ambulance</li><li>If, convulsions then, consider convulsion  protocol</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>Dont force things into seizing patients mouths.</li><li>Seizures may be caused by arrythmias, particularly in patients over 50.</li><li>Seizure activity may be caused by cerebral hypoxia from cardiac arrest, always check a pulse when seizures terminate.</li><li>Seizures in pediatric patients are commonly febrile seizures and are usually benign and short lived.</li><li>Pregnant women who seize may be eclamptic, treat using the Preeclampsia/Eclampsia Protocol</li></ul></div></div>', '0'),
(54, 214, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>Onset and duration of bleeding, amount, passage of clots or tissue, number of menstrual pads used.</li><li>Postpartum patients:  Time and place of delivery, history of complications.</li><li>Bleeding disorders or anticoagulant medications.</li><li>Evidence of blood loss, clots or tissue fragments.</li><li>Fever.</li><li>Signs of hypovolemic shock.\r\n</li></ul></div><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Inform History & Baseline vitals</li><li>If SBP<90 or HR>100,NS 200ml IV</li><li>Reassessment after each bolus</li><li>Assessment of neurovascular function</li><li> Shock management</li><li>Uterine Massage</li><li>Rapid transport</li><li>Care of new born</li><li>Using oxytocin is out of scope of EMS</li><li>Using Colloids vs. Crystalloids will have same effect. Use of colloids is not recommended on routine basis.  Colloids can be used only in cases of severe haemmorhages.  \r\n</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>Amount of vaginal bleeding is difficult to estimate.  Try to get an estimate of number of saturated pads in the previous 6 hours.  Discreet inspection of the perineum may be useful to determine if clots or tissue are being passed.</li><li>Patients in shock from vaginal bleeding should be treated using the Shock Protocol</li><li>If a non-viable premature fetus is delivered and the fetus is available, place the fetus in a clean container or sheet and transport to the hospital with the mother.</li></ul></div></div>', '0'),
(55, 215, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>History of seizure disorder (seizure with no prior history is more likely to be eclampsia).</li><li>History of headache, vision changes, right upper quadrant pain, peripheral edema.</li><li>Vital Signs: \r\no Blood pressure normally decreases during pregnancy.\r\no In the setting of pregnancy, hypertension is defined as BP >140/90 or a relative increase of\r\n30 mm hg SBP or 20 mm hg DBP from patients pre-pregnancy blood pressure.</li><li>Seizure activity.</li></ul></div><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li> Inform History & Baseline vitals\r\nConsider Airway management.</li><li>Oxygen  15 L/min during the convulsions</li><li>If SBP<90 or HR>100,NS 200ml IV bolus</li><li>Reassessment after each bolus</li><li>Rapid transport</li><li>If convulsions then follow protocol</li><li>Magnesium sulfate 4g IV (4 to 5 gm diluted in 250ml NS, IV infusion (to stop the convulsions). Then, 5gms deep IM in each buttock or after initial IV dose 1 to 3 gms per hour IV)</li><li>If, GRBS <80mg/dL consider hypoglycemia  protocol</li><li><div class=\"font-weight600\">Do not use diazepam, phenetoin.\r\nMidazolam can be considered as a second line of treatment if IV. MgSO4 has failed to stop the convulsions.<div></li><li>Closely Monitor foetal heart sounds.\r\nAssessment of neurological function</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>Disease of unknown origin.</li><li>Field diagnosis of preeclampsia based on findings of pregnancy, hypertension, and edema.</li><li>Usually occurs after 20th week of gestation. May occur up to 2 weeks postpartum.</li><li>Eclampsia occurs with the signs/symptoms of preeclampsia with seizures or coma.</li><li>Magnesium can cause respiratory depression and hypotension.</li></ul></div></div>', '0'),
(56, 216, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>Last time seen conscious or normal, progression of symptoms, recent symptoms such as headache, seizure, confusion, or trauma.  Medical problems and medication history, toxin exposure, history of seizure or stroke.</li><li>Psychiatric problems, recent crisis, bizarre or abrupt changes in behaviour, suicidal ideas, alcohol/drug intoxication, psychotropic or behavioural drugs.</li><li>Surroundings: Bring pill bottles, syringes etc., with patient.  Note any peculiar odours in the environment.</li><li>Pupils: Size, symmetry, and reactivity.</li><li>Mental status:  Altered mental status includes not only unconsciousness or confusion, but also irrational activity such as verbal attacks, spitting, or combativeness.  Note level of consciousness and neurologic status. Document GCS if applicable.</li><li>Look for signs of trauma, evidence of drug use such as needle tracks.</li><li>Characteristic odour on patients breath.</li></ul></div><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Safety for the patient and the crew is the primary concern in the transport of the mentally ill patient. Personnel should make sure they do a thorough evaluation of the patient to find and treat possible medical causes of the behaviour.</li><li>Judge & advice to physically restrain any patient who poses a threat to themselves or others.</li><li>Determine the type of restraint to be used.</li><li>Providers are cautioned to use physical restraint as a last resort, preferably with the assistance of local law enforcement.</li><li>Once the decision is made to restrain a patient, the patient should remain restrained until arrival at the hospital, unless it interferes with the delivery of medical care.</li><li>ERCP should first confirm if the patient is a known psychiatric & if a dose is missed.</li><li>Select appropriate sedation as last resort</li><li>ERCP to remember the commonest causes of AMS(Hypoglycaemia, Hypoxia, Metabolic disturbances, Electrolyte disturbance)</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>In cases of dangerous environment, safety of personnel on scene is paramount.</li><li>If there are multiple patients, suspect poisoning.</li><li>Be particularly attentive to airway management.  Aspiration of secretions, vomiting, and inadequate ventilations may be present in patients with severely altered mental status.</li><li>Hypoglycaemia may present as focal neurologic deficit or altered mental status, particularly in elderly patients.</li><li>All patients treated using this protocol should have a medical evaluation and should not be considered or referred to as a psychiatric patient unless under a bona fide mental health hold by a physician, mental health professional, or law enforcement officer.  Medical causes of altered mental status should be considered first before psychiatric causes of altered mental status.</li><li>CAUTION: Suicidal patients and patients with hallucinations or delusions may potentially exhibit violent behaviour.</li></ul></div></div>', '0'),
(57, 217, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>Onset and duration of bleeding, amount, passage of clots or tissue, number of menstrual pads used.</li><li>Last Menstrual period, pregnancy status, birth control method.</li><li>Pregnant patients:  Due date, Estimated Gestation Age.</li><li>Postpartum patients:  Time and place of delivery, history of complications.</li><li>Bleeding disorders or anticoagulant medications.</li><li>Evidence of blood loss, clots or tissue fragments.</li><li>Fever.</li><li>Signs of hypovolemic shock.\r\n</li></ul></div><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Inform history & Baseline vitals</li><li>Assess & manage Airway, Breathing, Circulation</li><li>If SBP<90mm of HG, or H.R.> 100/min, then IV NS 200ml bolus, reassess after each bolus.</li\r\n><li>If Shock is imminent SBP continues to remain < 90 mm of Hg after the bolus refer to shock protocols</li\r\n><li>If PPH refer PPH protocol.\r\n</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>Always consider pregnancy or ectopic pregnancy as the cause of the bleeding.</li><li>Amount of vaginal bleeding is difficult to estimate.  Try to get an estimate of number of saturated pads in the previous 6 hours.  Discreet inspection of the perineum may be useful to determine if clots or tissue are being passed (threatened abortion).</li><li>Patients in shock from vaginal bleeding should be treated using the Shock Protocol</li><li>If a non-viable premature fetus is delivered and the fetus is available, place the fetus in a clean container or sheet and transport to the hospital with the mother.</li></ul></div></div>', '0'),
(58, 218, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>Onset and duration of bleeding, amount.</li><li>Signs of hypovolemic shock.\r\nNote: Do not overlook other physical injuries</li></ul></div><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><ol type=\"1\"><li>Treat any life-threatening emergency first and according to these protocols.</li><li> Try to attend to maintenance of forensic evidence. Try not to cut through tears or stains in clothing. Do not cleanse any skin area more than necessary to provide immediate care.</li><li>If the patient so desires and/or mandated reporting is indicated, police should be called if they have not already been notified.</li><li>If no life-threatening situation is present, pre-hospital care may require waiting for police to secure the scene which is a potential crime scene.</li><li>Victims of sexual assault commonly have much guilt, and may require psychological support. Please respect the stress that they are enduring.</li><li>By nature of this event, any touch may be traumatic for this patient. Overtly and repeatedly explain what you are doing to try to lessen the impact of procedures and touching.</li><li>Advise the patient not to eat, drink, smoke, bathe, change clothing or go to the bathroom if at all possible in order to preserve any forensic evidence. If they must urinate, request that they do not wipe.</li><li>If the patient has removed any clothing worn in the assault, each piece of clothing should be separately bagged in paper bags and brought to the hospital with the patient.</li><li>When transporting the patient, it is preferable whenever possible to have a same sex provider as the primary provider. If the assault is a same sex assault, than a provider of the opposite sex may be more comfortable for the patient.</li><li>To maintain privacy and confidentiality, do not clarify the type of assault; only refer as victim of assault.</li><li>The patient should be encouraged to go to the hospital for a sexual assault forensic examination that would allow not only the option to have collection of forensic evidence, but also treatment of possible injuries and the chance to obtain pregnancy and sexually transmitted disease prophylactic treatment.</li><li>If the patient refuses treatment and/or transportation to the hospital, document all findings and observations as completely as possible. When signing the patient off at the scene, try to have a police officer witness this sign off.</li><li>Notify ERC</li><li>Victim should preferably be accompanied by (female) relative/ female police constable in the ambulance.</li></ol></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>Amount of vaginal bleeding is difficult to estimate.</li><li>Patients in shock from vaginal bleeding should be treated using the Shock Protocol\r\n</li></ul></div>', '0'),
(59, 219, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><p>Evidence of inadequate organ perfusion:</p><p> Pulse>120, SBP<90 mmHg (adult), skin cold and clammy, altered mental status.</p></ul></div><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Inform History & Baseline vitals</li><li> Assess and manage ABC</li><li>If SBP<90 or HR>100,NS 200ml IV bolus</li><li>Reassessment after each bolus</li><li> H/O Coronary artery disease/ Dilated Cardiomyopathy- Careful in giving fluids</li><li>Assessment of type of shock</li><li>Treat underlying causes</li><li>If persistent hypotension consider hemorrhagic or septic shock</li><li> Consider 2 large bore IVs</li><li>Suspected Traumatic Brain Injury/CNS injury, internal bleeding  Rapid transport</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><p>Types of shock:</p><li>Hypovolemic:  Loss of circulating blood volume. This may be due to hemorrhage or through loss of fluids such as through vomiting, diarrhea, poor intake, or burns.</li><li>Cardiogenic:  Pump failure.</li><li>Distributive: Decreased vascular tone.  Includes anaphylaxis, sepsis, and neurogenic shock.</li><li>Obstructive: mechanical obstruction to blood flow to or from the heart. Includes cardiac tamponade, tension pneumothorax, dissecting aortic aneurysm, and pulmonary embolism.\r\n</li></ul></div></div>', '0'),
(60, 220, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>Type of bite/sting and description of snake.</li><li>Exacttime, location, size of bite</li><li>Rash, wound, soft tissue swelling, redness, amount of pain.</li><li>Bleeding or neurological signs like ptosis\r\nDetermine if any traditional medicines have been used. \r\n</li></ul></div><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Inform History & Baseline vitals\r\nABC\r\nFor pain, give paracetamol or tramadol tablets</li><li>If SBP<90 or HR>100,NS (200 ml) 500ml IV</li><li>Reassessment after each bolus</li><li>Anti-snake Venom (ASV) if available; contact ERCP \r\n\r\nIf signs of coagulopathy (Hematuria/ gum bleeding)or neurotoxicity (ptosis, difficulty swallowing,) start anti-snake venom (ASV).\r\nBefore administrating ASV give injection Hydro-cortizon 100milligram+ Injection AVIL.\r\nDose of ASV- 8-10 vials (10 ml/vial) either as intra-venous infusion (5-10 ml/kg body weight ) OR as slow intra-venous injection i.e. 2 ml/ minute\r\nLocal administration of ASV near or at the site should not be done. \r\nIf anaphylaxis with ASV, follow anaphylaxis protocol.\r\nInjection Neostigmin in post-synaptic neuro-toxin.\r\nDose- 0.5-2milligram IV, Repeated  hrly for 8 Hrs. \r\nInjection Atropin 0.5 milligrams, 15 mins prior to injection Neostigmin and before every fourth dose of Inj. Neostigmin.</li><li>If, hypotension, convulsions then, consider appropriate  protocol\r\n\r\n\r\n\r\nRef- National guidelines for Management of Snake bite.\r\n</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>It is no longer recommended to use tourniquets or venom extractors to treat snakebites.</li><li>Do not wash the wound or bite site</li><li>Do not give cuts or incision near the bitten area</li><li>No electrical shock</li><li>Do not freeze or apply extreme cold to the area of bite.</li><li>Do not suck venom out with your mouth.</li><li>While identification of the snakeis important, remember that safety of the EMSO is more important than killing and/or identifying the snake.  Consider taking a photo of the snake toshow to the receiving physician if a camera is available to you.</li></ul></div>', '0'),
(61, 221, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>Onset and duration of bleeding, amount, passage of clots or tissue, number of menstrual pads used.</li><li>Last Menstrual period, pregnancy status, birth control method.</li><li>Pregnant patients:  Due date, Estimated Gestation Age.</li><li>Bleeding disorders or anticoagulant medications.</li><li>Evidence of blood loss, clots or tissue fragments.</li><li>Fever.</li><li>Signs of hypovolemic shock.</li><li>EMSO is not supposed to do PV\r\n</li></ul></div><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Inform History & Baseline vitals</li><li>If SBP<90 or HR>100,NS 200ml IV NS</li><li>Reassessment after each bolus</li><li>Assessment of neurovascular function</li><li>Sterile vaginal pads</li><li>Rapid transport</li><li>If shock present  follow shock protocol</li><li>EMSO should compulsorily transport the patient</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>Amount of vaginal bleeding is difficult to estimate.  Try to get an estimate of number of saturated pads in the previous 6 hours.  Discreet inspection of the perineum may be useful to determine if clots or tissue are being passed.</li><li>Patients in shock from vaginal bleeding should be treated using the Shock Protocol</li><li>Always consider pregnancy or ectopic pregnancy as the cause of the bleeding.</li><li>If a non-viable premature foetus is delivered and the foetus is available, place the foetus in a clean container or sheet and transport to the hospital with the mother.</li></ul></div>', '0'),
(62, 222, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>Last time patient was seen normal.</li><li>Existing previous neurologic deficit.</li><li>Stroke risk factors (hypertension, diabetes, heart disease, smoking, dysrhythmias, warfarin or heparin use, or previous stroke).</li><li>Has the patient had any recent similar events?</li><li>Level of consciousness:  Alert, Responds to Voice, Responds to Pain, Unconscious.\r\n\r\nPerform FAST stroke scale (Face, Arm, Speech, Time):<ul><ol type=\"1\"><li >Face:  Assess for facial droop:  have the patient show teeth or smile.</li><ul class=\"style1\"><li>Normal  both sides of face move equally.</li><li>Abnormal  one side of face does not move as well as the other side.</li></ul><li>Arm:  Assess for arm drift:  have the patient close eyes and hold both arms straight out; with palms up, for 10 seconds.</li><ul class=\"style1\"><li>Normal  both arms move the same or both arms do not move at all.</li><li>Abnormal  one arm does not move or one arm drifts down compared to the other.</li></ul><li>Speech:  Assess for abnormal speech:  have the patient say you cant teach an old dog new tricks.</li><ul class=\"style1\"><li>Normal  patient uses correct words with no slurring.</li><li>Abnormal  patient slurs words, uses the wrong words, or unable to speak.</li></ul><li>Time: If any of above are positive, attempt to determine the time of symptom onset (clock time).</li>NOTE: THERE IS NO SCORE, if 1, 2, or 3 are abnormal; the probability of a stroke is 72%.</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>This protocol is for patients who have an acute episode of neurologic deficit without any evidence of trauma. If the patient has altered mental status, treat using the Altered Mental Status Protocol</li><li>Determining the exact time of symptom onset is critical since administration of thrombolytic drugs for the treatment of stroke is time-dependent.</li><li>High blood pressure during an acute stroke may be compensatory, do not attempt to lower it</li><li>Intravenous glucose may aggravate the effects of ischemia upon brain tissue. Do not administer glucose unless hypoglycaemia is documented.</li><li>Transport the patient to the appropriate stroke center.</li><li>Notify the receiving facility that you are bringing a possible stroke patient.</li></ul></div><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Inform History & Baseline vitals</li><li>Oxygen + airway</li><li><div class=\"font_weight600\">Do BSL</div></li><li>If blood glucose less than 80 mg/dL administer Dextrose 25 % solution IV</li><li>Watch for deterioration & LOC</li><li>Follow Altered mental status protocol if needed</li><li>Hypertension control is practised only if there are signs of herniation(avoid drastic reduction in the Blood Pressures)</li><li>Non persisting symptoms consider TIA\r\nRemember- BP should not be brought down drastically (recommended150-160 SBP 80-100 DBP)</li></ul></div></div>', '0'),
(63, 223, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>Description of event:  Onset, duration, seizure activity, precipitating factors, activity when syncope occurred.</li><li>Pregnancy status.</li><li>Medications, past medical history, or prior syncope.</li><li>Vertigo, nausea, chest or abdominal pain.</li><li>Neurologic exam.</li><li>Evidence of head trauma.</li><li>Ask for H/O DM and HTN\r\n</li></ul></div><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Inform History & Baseline vitals</li><li>Oxygen+ airway</li><li>If blood glucose less than 80 mg/dL administer Dextrose 25 % solution IV</li><li>Naloxone (Narcan) 0.1  2 mg IV, SC, IM only give if respirations less than 12 per minute and you suspect narcotic overdose- (first confirm its availability from the EMSO)</li><li>Watch for deterioration in GCS</li><li>Altered mental status protocol if needed\r\nHypertension control is practised only if there are signs of herniation(avoid drastic reduction in the Blood Pressures)</li><li>If unattended unconscious patient- ERCPs should inform PDA</li><li>ERCP should advice EMSO to be aware of the belongings and valuables of patient- they should be handed over to police, note down and take a signature of police</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>Syncope is a transient state of unconsciousness from which the patient has recovered.  If the patient is still unconscious, treat using the Altered Mental Status or Shock Protocols as indicated.</li><li>Most syncope is vasovagal.  Placing the patient in the recumbent position should be sufficient to restore vital signs and level of consciousness to normal.  Other causes may be:  cardiac\r\ndysrhythmias, hypotension, aortic dissection, GI bleed, hypoglycaemia, seizure, stroke and transient ischemic attack.</li><li>Syncope while in a recumbent position is almost always of cardiac origin.</li><li>Syncope of recent onset in middle-aged or elderly patients is often cardiac and deserves special concern.</li><li>Special situations- hunger strike(to note last meal intake) - medicolegal implications</li><li>Common causes- Alcohol intoxication</li><li>ERCPs To remain aware of other causes of unconsciousness- Traumatic causes.\r\n</li></ul></div></div>', '0'),
(64, 224, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>Pain:  PQRST-Place, Quality, Radiation, Severity, and Time Began.</li><li>Symptoms:  Nausea, vomiting (bloody or coffee-ground), diarrhoea, constipation, melaena, rectal bleeding, urinary difficulties, or fever.</li><li>History:  Previous trauma, abnormal ingestion, medications, known disease, surgery, menstrual history, possibility of pregnancy.</li><li>Abdomen:  Tenderness, guarding, rigidity, bowel sounds, distention, pulsating mass, evidence of rectal bleeding.</li><p>Note: signs of traumatic abdominal injury(bruises, abrasions, penetrating injuries etc</p><p>Note: Evisceration injuries</p></ul></div><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Inform History & Baseline vitals</li><li>Oxygen</li><li>If SBP<90 or HR>100,NS 500ml IV</li><li>Reassessment after each bolus</li><li>Do not remove impaled objects, Stabilize Object</li><li>Do not push the eviscerated organs back into the abdomen.</li><li>Try to keep abdominal girth/ distension in mind- internal haemorrhage.</li><li>Inform PDA/ MLC in case of assault</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>Abdominal pain may be the first warning of catastrophic internal bleeding leading to hemorrhagic shock.  Maintain a high index of suspicion and monitor for early signs of shock.</li><li>Use caution with fluid administration in patients with suspected dissecting aortic aneurysm.  Do not try to exceed systolic BP of 90 mmHg.</li></ul></div></div>', '0'),
(65, 225, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><li>Allergen exposure and route of exposure.</li><li>History and type of previous allergic reactions.<p>Symptoms:</p></li><li>Pruritus, dyspnoea, sensation of airway closure, generalized weakness or dizziness.</li><li>Skin:  Hives, swelling, or erythema.</li><li>Airway: Oropharyngeal oedema, drooling.</li><li>Pulmonary: Wheezing, stridor, hoarseness, inability to speak</li><li>Cardiovascular:  Hypotension.\r\n(Airway compromise & haemodynamic instability would indicate anaphylaxis- is there a need to mention the above in allergic reactions?)</li></ul></div></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Inform History and Baseline vitals<li>Oxygen + Consider advances airway techniques</li><li>Fluid challenge: 200ml NS IV bolus repeat SOS</li><li>Inj. Chlorpheniramine maleate 1 amp (22.75 mg/ml) IM/IV stat</li><li>If wheezing present: Salbutamol 5mg via nebulizer (Not available in the ambulance- salbutamol inhaler without spacer available)</li><li>Inj .Dexamethasone (8mg) IV or Inj. Hydrocortisone(100mg) IV</li></ul></div></div>', '0');
