(66, 226, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM</h2><ul><div class=\"iden_mark\">Mechanism of Injury:   Elements that should increase suspicion for spine injury and prompt screening for spinal injury include:</div><li>Axial Loading (diving).</li><li>Blunt trauma to head or neck.</li><li>Motor Vehicle Crash.</li><li>Fall> 3 feet or an adult falling from standing height.</li><li>Any violent mechanism of injury with high energy transfer.</li><li>History of arthritis of spine.\r\n\r\nPatient Reliability: Assessment for spinal injury can only be utilized if the patient is alert, calm, cooperative, and not intoxicated.  If there is a communication barrier, the patient cannot be properly assessed and based on mechanism and any complaint of injury the patient should receive SMR.\r\n\r\nDistracting Injury: Any painful injury might distract the patient from the pain of a spine injury. Both medical as well as traumatic causes for pain can be considered a distracting injury.  If the patient has\r\nan injury or illness that seems to be causing enough pain to provide a distraction, the spine cannot be cleared clinically.\r\n\r\nNeurologic Evaluation:  A patient who is reliable and has no distracting injury should be examined for any neurologic deficits.</li><li>Have the patient spread the fingers of his or her hand and resist as you try to squeeze them together.  There should be some resistance as you squeeze</li><li>Ask the patient to hold his or her hand out with the palm facing down.  While supporting the wrist, ask the patient to resist while you push down on the dorsal surface of the hand or fingers. The patient should be able to provide some resistance.</li><li>Move your hand to the top of the foot and ask the patient to pull his or her toe towards nose against your resistance.  The patient should be able to apply pressure to your hand.</li><p>Sensory:</p><li>Assess for the ability to distinguish soft and sharp sensation in each hand and foot. Use a sharp object and a soft object.  A corner of a gauze pad and a pencil may be used.</li><li>Alternately apply the soft and then the sharp object to each extremity. Do not let the patient know which one was used.  Ask the patient whether the sensation is soft or sharp.  Repeat soft and sharp in all extremities.</li><li>The patient should be able to distinguish soft from sharp.</li><p>Complaints of Pain or Examination Tenderness:</p><li>Palpate the entire spine. Any complaint of pain or tenderness to palpation along any part of the spine should be considered an indication that the patient requires full SMR.</li><li>Ask the patient about sensations of numbness, tingling, shooting pain, or motor weakness in any extremity.  Any positive response requires full SMR.</li><li>Some components of the sensory examination are subjective. When in doubt, apply SMR.</li></ul></div><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Apply C collar, spine board</li><li>Do not log roll the patient in suspected pelvic fractures.</li><li>Inform History & Baseline vitals</li><li>If SBP<90 or HR>100,NS 200ml IV</li><li>Reassessment after each bolus </li><li>Do not pack ear or nose bleed in the field</li><li>Inj. Tramadol 50 milligrams for pain management.</li><li>Watch for spinal shock</li><li>Rapid transport</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>Full SMR as an automatic response to trauma may not always be in the patients best interest.\r\nPatients packaged on hard SMR devices may develop complications or problems due to laying on a hard spineboard.  These complications or problems could potentially be avoided if a spinal\r\nassessment tool is utilized to reduce the number of patients unnecessarily placed in SMR.\r\n</li><li>Use of a backboard for stabilization of some other injury than the spine, or to move the patient does not mean that SMR is indicated.</li><li>Use of cervical motion restriction in adults should always be followed with SMR. Do not secure the head to the backboard before securing the body (it can cause torsion on the neck).</li><li>SMR with a cervical collar and a vacuum mattress is a recommended technique.  A vacuum mattress, when available, is preferred for all but short transports.</li><li>Vomiting should be expected in head injury patients.  Therefore, the patient should be securely strapped to a long board to enable board and patient to be turned as a unit.  EMSO should be aware that additional help may be necessary during transport to turn patient and manage airway while maintaining cervical spine integrity.</li><li>Vomiting should be expected in head injury patients.  Therefore, the patient should be securely strapped to a long board to enable board and patient to be turned as a unit.  EMSO should be aware that additional help may be necessary during transport to turn patient and manage airway while maintaining cervical spine integrity.</li><li>Most adults require 1 to 1  inches of firm padding behind the head to assume standard neutral anatomic position, and some additional padding behind the neck is necessary for full support. Most children require padding under the shoulders to maintain neutral spinal alignment.</li><li>A rigid cervical collar, continuous manual in-line support during rapid extrication onto a long spine board, and rapid transport should be substituted for more time consuming methods in the severely traumatized patient requiring immediate lifesaving intervention.</li><li>Airway problems, respiratory difficulty, and shock are common in the traumatized patient.\r\nAlternate techniques for performing airway procedures should be used in spinal injured patients. To maintain proper control of the cervical spine during endotracheal intubation, in-line stabilization must be performed by two EMSOs.</li><li>If any motion restriction techniques cause an increase in pain or neurologic deficit, the patient should be stabilized in position found or position of greatest comfort.</li><li>Geriatric patients (over 55) should raise a higher index of suspicion for the EMSO due to physiologic aging changes.  The EMSOs awareness of the need to provide for cervical spine motion restriction should be more acute in these patients.</li></ul></div><div class=\"madv_ans\"><h2>Documentation:</h2><ul><div class=\"iden_mark\">In any case where there is head and/or facial injury, or a mechanism of injury suggesting the possibility of a cervical spine injury, clear and concise documentation is absolutely essential.  In the cases where the decision not to provide SMR is made, documentation must include the following information:</div><li>The examination was performed on a reliable patient.</li><li>The patient denies having any spinal pain.</li><li>The patient denies having any extremity weakness or loss of movement.</li><li>The patient denies having any tingling or feeling of pins and needles in the extremities.</li><li>There is no pain on palpation of the spine.</li><li>Motor function is intact in all of the extremities.</li><li>Sensation is intact in all extremities.</li></ul></div> </div>', '0'),
(67, 227, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>HISTORY AND PHYSICAL EXAM - Head Trauma</h2><ul><li>History: Mechanism of injury, Level of Consciousness changes.</li><li>Past medical history.</li><li>Protective devices:  helmet or seat belts.</li><li>Evaluate airway patency, breathing capability, and gross injuries to extremities and trunk.</li><li>Document Glasgow Coma Scale (Document all 3 component scores, as well as the total: Eyes, Verbal, and Motor).</li><li>Pupil position and response to light stimulation.</li><li>External evidence of head trauma, (e.g., blood from ears, or scalp lacerations).</li></ul></div><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><li>Inform History & Baseline vitals / BSL</li><li>If SBP<90 or HR>100,NS 200ml IV</li><li>Reassessment after each bolus</li><li>Consider  Inj. Fentanyl 1 microgram/ Kg IV PRN severe pain may repeat X 1after 15 min PRN for continuing pain</li><li>Assessment of neurovascular function</li><li>If extremity is pulseless, attempt gentle in line traction to restore normal anatomic position</li><li>Bind Pelvic fracture</li><li>Evaluate types of burns and %BSA \r\n(Note- Role of mannitol in head injury is controversial)</li></ul></div></div><div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>KEY POINTS</h2><ul><li>Note changes in the patients GCS score in relation to time intervals.\r\n</li><li>Always consider cervical spine injury in patients with head trauma.</li><li>Head injury does not cause shock in adults. If shock is present in an adult patient with head trauma, consider that there is probably another cause of shock.</li><li>Head injury can cause shock in infants.</li><li>Other causes of alteration of level of consciousness should be ruled out.</li><li>Hypoventilation can cause cerebral edema.  Maintain rate of 8 breaths per minute or, if using capnography, maintain CO2 35-45.</li><li>If signs of cerebral herniation (extensor posturing, dilated or nonreactive pupils, or decrease in GCS of >2 if the initial was <9) Hyperventilation (rate 20 bpm) \r\n</li></ul></div></div>', '0'),
(68, 191, '<div class=\"width2 float_left\"><div class=\"madv_ans\"><h2>ERCP ADVICE</h2><ul><div class=\"iden_mark\">As per individual case and injuries\nPCR should be written for each case\nComment: TRIAGE is taught in training during EMSO orientation.\nAs per the situation and if the situation demands additional resources the EMSO should inform ERCP/ERC/DM\nERCP should advice EMSO not to carry more than 1 serious patients in one ambulance\nERCP should ensure that the particular incident is forwarded to PDA cell/ TL/ Shift Manager in ERC\nDead patients(based on triage) should be preferably left at scene\nERCP has to ascertain Dead patient on telephone as per the guidelines in the software at ERC.(Death on arrival)\n(Triage death is only absent respiratory effort on opening of airway)</div></ul></div></div>', '0');
