INSERT INTO `ems_mas_sms` (`sms_id`, `ct_id`, `sms_msg`) VALUES
(1, 1, 'DO NOT give anything to eat or drink. Keep medical records ready to carry to the hospital'),
(2, 2, 'keep patient and yourself safe from injury. Keep medical records ready to carry to the hospital'),
(3, 3, 'remove allergic agent away from patient. Keep medical records ready to carry to the hospital\r\n'),
(4, 4, 'DO NOT give anything to eat or drink. Keep medical records ready to carry to the hospital'),
(5, 5, 'make sure scene is safe for you and patient. DONOT try to capture the animal. Keep medical records ready to carry to the hospital'),
(6, 6, 'do not go near the assailant till police arrive. DONOT disturb the crime scene Keep medical records ready to carry to the hospital'),
(7, 7, 'DO NOT move the patient. Keep medical records ready to carry to the hospital'),
(8, 8, 'DO NOT give anything to eat or drink. DONOT make the patient lie down. Keep medical records ready to carry to the hospital'),
(9, 9, 'make sure the scene is safe for you. Remove burnt clothing or jewelry. Wrap the patient in blanket.  Keep medical records ready to carry to the hospital'),
(10, 10, 'DONOT let the patient walk around. Keep the patient calm and in comfortable position. Keep medical records ready to carry to the hospital'),
(11, 11, 'DO NOT give anything to eat or drink. If trained, give CPR in case the patient is unconscious. Keep medical records ready to carry to the hospital'),
(12, 12, 'give lemonade to drink if patient is conscious and oriented. . Keep medical records ready to carry to the hospital'),
(13, 13, 'DO NOT try to save the patient if you cannot swim. DONOT give abdominal compressions. Give CPR if trained.'),
(14, 14, 'DO NOT give anything to eat or drink if patient is confused. Make the patient lie down with feet elevated by 12 inch.. Keep medical records ready to carry to the hospital'),
(15, 15, 'DO NOT touch the victim if still connected to power source. Shut down the main power source.  Keep medical records ready to carry to the hospital'),
(16, 16, 'DO NOT remove impaled object if any. In case of chemical exposure, rinse the eye with water. Do not rub the eye.'),
(17, 17, 'DO NOT give anything to eat or drink if patient is confused. Make the patient lie down with feet elevated by 12 inch.. Keep medical records ready to carry to the hospital'),
(18, 18, 'DO NOT move the victim. Put pressure on any bleeding wounds. Keep medical records ready to carry to the hospital'),
(19, 19, 'DONOT give anything to eat or drink if the patient is not awake. Keep medical records ready to carry to the hospital.'),
(20, 20, 'DO NOT enter the scene till EMS personnel arrive.'),
(21, 21, 'DO NOT give anything to eat or drink if patient is confused. Keep medical records ready to carry to the hospital'),
(22, 22, 'DO NOT give anything to eat or drink if patient is confused. Make the patient lie down on their left side.  Keep medical records ready to carry to the hospital'),
(23, 23, 'DO NOT give anything to eat or drink if patient is confused. Give juice with extra sugar if patient is conscious.  Keep medical records ready to carry to the hospital'),
(24, 24, 'Make sure scene is safe for you. Remove wet clothes. Wrap the patient in blankets.  If awake give warm drink.  Keep medical records ready to carry to the hospital'),
(25, 25, 'keep the patient in shade under a fan at high speed. DO NOT give anything to eat or drink if patient is confused. give juice with salt and sugar if the patient if fully awake'),
(26, 26, 'DO NOT give anything to eat or drink if patient is confused. DO NOT induce vomiting. Keep medical records ready to carry to the hospital'),
(27, 27, 'DO NOT give anything to eat or drink if patient is confused. Make the patient lie down on left side. Keep medical records ready to carry to the hospital'),
(28, 28, 'DO NOT give anything to eat or drink if patient is confused. DO Not let patient go to the toilet. Keep surrounding safe. Keep medical records ready to carry to the hospital'),
(29, 29, ''),
(30, 30, 'Make sure scene is safe for you and the patient. DONOT try to control the victim.  Keep medical records ready to carry to the hospital'),
(31, 31, 'DO NOT give anything to eat or drink if patient is confused. Lie the patient on his left side. Keep medical records ready to carry to the hospital'),
(32, 32, 'DO NOT give anything to eat or drink if patient is confused. DO Not shake the victim. Keep medical records ready to carry to the hospital'),
(33, 33, 'make sure scene is safe. DO NOT move the victim. Keep pressure on any bleeding wounds. Do not remove the helmet. Only open the face screen'),
(34, 34, 'make sure scene is safe. DO NOT move the victim. Keep pressure on any bleeding wounds.'),
(35, 35, 'make sure scene is safe. DO NOT move the victim. Keep pressure on any bleeding wounds.'),
(36, 36, 'make sure scene is safe. DO NOT move the victim. Keep pressure on any bleeding wounds.'),
(37, 37, 'make sure scene is safe. DO NOT move the victim. Keep pressure on any bleeding wounds.'),
(38, 38, 'make sure scene is safe. DO NOT move the victim. Keep pressure on any bleeding wounds.'),
(39, 39, 'make sure scene is safe. DO NOT move the victim. Keep pressure on any bleeding wounds.'),
(40, 40, 'make sure scene is safe. DO NOT move the victim. Keep pressure on any bleeding wounds.'),
(41, 41, 'make sure scene is safe. Try to take victim away from the vehicle.  Keep pressure on any bleeding wounds.'),
(42, 42, 'make sure scene is safe. DO NOT move the victim. DO Not try to safe the victim if you cannot swim and are alone. Keep pressure on any bleeding wounds.'),
(43, 43, 'make sure scene is safe for victim. DO NOT restrain the victim. After the fit, keep patient turned on their left side. Keep medical records ready'),
(44, 44, 'make sure scene is safe. DO NOT move the victim. DO NOT touch any exposed organs. Keep pressure on any bleeding wounds.'),
(45, 45, 'make sure scene is safe. DO NOT move the victim. Keep pressure on any bleeding wounds.'),
(46, 46, 'make sure scene is safe. DO NOT move the victim. Keep pressure on any bleeding wounds.'),
(47, 47, 'make sure scene is safe. DO NOT move the victim. Keep pressure on any bleeding wounds.'),
