(49, 49, 'DO NOT give anything to eat or drink. Lie the patient on their left side. Keep medical records ready.'),
(50, 50, 'DONOT give anything to eat or drink. Give CPR if needed and only if you are trained. Keep the patient on their left side. Keep medical records ready.'),
